var Htmlstring = exports.Htmlstring = "<div class=\"container\">\n\n<div class=\"panel panel-primary\">\n  <div class=\"panel-heading\">Info</div>\n  <div id=\"hide_show\">hide</div>\n  <span style=\"display:inline;margin-left:50px;\">Answer-font:</span>\n  <i id=\"increase\" class=\"fa fa-plus\" aria-hidden=\"true\" style=\"display:inline; margin-left:0px\"></i>\n  <i id=\"decrease\" class=\"fa fa-minus\" aria-hidden=\"true\" style=\"display:inline; margin-left:10px\"></i>\n  <span id=\"default_font\" class=\"label label-default\" style=\"display:inline;cursor:pointer;\">Default</span>\n  <div style=\"margin-left:30px;margin-top:4px;display:inline-block;\">\n    <span style=\"margin-right:5px;\">View: </span>\n    <div class=\"btn-group\">\n      <span class=\"change_header\" id=\"drugs_header\" style=\"color:#9734d7;\">Drugs</span>\n      <span class=\"change_header\" id=\"condition_header\" style=\"color:#f42d2d;\">Condition</span>\n      <span class=\"change_header\" id=\"sides_header\" style=\"color:#aa5d0;\">Sides</span>\n      <span class=\"change_header\" id=\"general_header\" style=\"color:#aaa407;\">General</span>\n      <span class=\"change_header\" id=\"lifestyle_header\" style=\"color:#3736ac;\">Lifestyle</span>\n      <span class=\"change_header\" id=\"other_header\" style=\"color:#00950b;\">Other</span>\n      <span class=\"change_header\" id=\"procedures_header\" style=\"color:#9d3c3c;\">Procedures</span>\n      <span class=\"change_header\" id=\"statistic_header\" style=\"color:#9d3c3c;\">Statistics</span>\n\n    </div>\n  </div>\n  <div class=\"panel-body\">\n    <p>&nbsp;&nbsp;&nbsp;On this page you can find almost\n      <b>\"all\"</b> the questions you have asked yourself about PPIs. Answers were collected from trusted websites and are\n      <b>very accurate</b>. The majority of answers are linked to their original source (some answers have multiple sources),\n      the other answers are given by the author of the app\n      and are based on his information gathering for the last 3 years about the PPIs. Some questions\n      do not have answers because they haven\u2019t been found anywhere on the Internet. Remember, the vast majority of answers\n      are accurate and those who do not have or have little knowledge about their condition and this drug or would like\n      to learn more should learn from them.</p>\n    <p>\n      &nbsp;&nbsp;&nbsp;The key for every disease and its treatment in the patient perspective is to gain as much knowledge as\n      possible. Once you get familiar with your condition and therapy you can then manage your lifestyle more efficiently.\n      Upper abdominal disease (stomach, esophagus) can be controlled with natural treatments, drugs, diet, surgery, psychological\n      treatment etc. The more we know, the better it gets.\n    </p>\n    <p>\n      &nbsp;&nbsp;&nbsp;Knowledge allows us to talk more efficiently with doctors (GPs, specialist) and ask the most important\n      questions that we still don\u2019t know, likewise we can participate in a much better way on forums/discussion groups and\n      ask more concise questions.\n    </p>\n    <hr/>\n    <div id=\"hide_show_second\">hide</div>\n    <span class=\"opinion_copy\" style=\"display:inline-block\">my opinion</span>\n    <p style=\"display:inline-block\">The given answer to the question is based on the author's research on the web and does not have an url pointing to an answer\n      location\n    </p>\n    </br>\n    <span class=\"knowledge_copy\" style=\"display:inline-block;margin-left:0px;\">knowledge</span>\n    <p style=\"display:inline-block;margin-left:3px;\">All the questions with this tag should be learned by a patient and represent the basic knowledge which a patient\n      should have regarding his disease and therapy</p>\n    </br>\n    <span class=\"interesting_copy\" style=\"display:inline-block;margin-left:0px;\">interesting</span>\n    <p style=\"display:inline-block;margin-left:3px;\">Tag is self explanatory. Represents an interesting question</p>\n    <hr/>\n    <div id=\"spell_it\" style=\"margin-bottom:-10px\">\n      <span style=\"color:#6e6e9b\">Correct spelling: </span>\n      <span id=\"spelling_box\">\n        <span class=\"spelling\">Esophagus</span> or\n        <span class=\"spelling\">Oesophagus</span> |\n        <span class=\"spelling spelling_left\">PPIs</span> or\n        <span>PPI\u2019s</span> |\n        <span class=\"spelling_left\">Barretts</span> or\n        <span class=\"spelling\">Barrett\u2019s</span>\n      </span>\n    </div>\n    <br/>\n    <p style=\"display:inline;\">Total questions\n      <span class=\"badge\" style=\"margin-left:4px;\">137</span>\n    </p>\n    <p style=\"display:inline;margin-left:10px;\">Total answers\n      <span class=\"badge\" style=\"margin-left:4px;\">133</span>\n    </p>\n  </div>\n</div>\n<div class=\"bd-example\" data-example-id=\"\">\n  <div id=\"accordion\" role=\"tablist\" aria-multiselectable=\"true\">\n    <h3 id=\"drug_heading\" style=\"color:#9734d7;\">Drugs</h3>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"headingOne\">\n        <h5 class=\"mb-0\">\n          <a class=\"collapsed heading_link_size\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapseOne\" aria-expanded=\"false\"\n            aria-controls=\"collapseTwo\">\n            <span class=\"increment_number\"></span> Are PPIs safe long-term?\n          </a>\n        </h5>\n      </div>\n      <div id=\"collapseOne\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingOne\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.medscape.com/viewarticle/820136_4\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          PPIs are an efficacious and safe drug class. They offer relief to patients in a patient-centered healthcare system. Unfortunately,\n          these agents do potentially have some long-term consequences from continued use, including malabsorption issues\n          and increased risk of infections. The pharmacist can be an advocate for the patient in the hospital system\n          or in the community by understanding these risks and fostering patient-centered care by empowering a well-informed\n          patient in healthcare decisions.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"headingTwo\">\n        <h5 class=\"mb-0\">\n          <a class=\"collapsed heading_link_size\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapseTwo\" aria-expanded=\"false\"\n            aria-controls=\"collapseTwo\">\n            <span class=\"increment_number\"></span> How do PPIs work?\n          </a>\n          <span class=\"knowledge\">knowledge</span>\n        </h5>\n      </div>\n      <div id=\"collapseTwo\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingTwo\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://patient.info/health/proton-pump-inhibitors\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          PPIs stop cells in the lining of the stomach producing too much acid. They are called 'proton pump inhibitors' because they\n          work by blocking (inhibiting) a chemical system called the hydrogen-potassium adenosine triphosphatase enzyme\n          system (otherwise known as the 'proton pump'). This chemical system is found in the cells in the stomach lining\n          that make stomach acid. The proton pump is the terminal stage in gastric acid secretion, being directly responsible\n          for secreting H+ ions into the gastric lumen, making it an ideal target for inhibiting acid secretion.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"headingThree\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapseThree\" aria-expanded=\"false\"\n            aria-controls=\"collapseThree\">\n            <span class=\"increment_number\"></span> What are low, normal and high PPIs dosage?\n          </a>\n          <span class=\"knowledge\">knowledge</span>\n        </h5>\n      </div>\n\n      <div id=\"collapseThree\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingThree\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"https://www.nice.org.uk/guidance/cg184/chapter/appendix-a-dosage-information-on-proton-pump-inhibitors\" class=\"url\"\n            target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n\n          <table border=\"1\" align=\"center\" class=\"bordered\">\n            <colgroup>\n              <col>\n              <col>\n              <col>\n              <col>\n            </colgroup>\n            <tbody>\n              <tr>\n                <td align=\"left\" valign=\"top\">\n                  <p>PPI</p>\n                </td>\n                <td align=\"left\" valign=\"top\">\n                  <p>Full/standard dose</p>\n                </td>\n                <td align=\"left\" valign=\"top\">\n                  <p>Low dose (on-demand dose)</p>\n                </td>\n                <td align=\"left\" valign=\"top\">\n                  <p>Higher dose</p>\n                </td>\n              </tr>\n              <tr>\n                <td align=\"left\" valign=\"top\">\n                  <p>Esomeprazole</p>\n                </td>\n                <td align=\"left\" valign=\"top\">\n                  <p>20 mg once a day</p>\n                </td>\n                <td align=\"left\" valign=\"top\">\n                  <p>Not available</p>\n                </td>\n                <td align=\"left\" valign=\"top\">\n                  <p>40 mg once a day</p>\n                </td>\n              </tr>\n              <tr>\n                <td align=\"left\" valign=\"top\">\n                  <p>Lansoprazole</p>\n                </td>\n                <td align=\"left\" valign=\"top\">\n                  <p>30 mg once a day</p>\n                </td>\n                <td align=\"left\" valign=\"top\">\n                  <p>15 mg once a day</p>\n                </td>\n                <td align=\"left\" valign=\"top\">\n                  <p>30 mg twice a day</p>\n                </td>\n              </tr>\n              <tr>\n                <td align=\"left\" valign=\"top\">\n                  <p>Omeprazole</p>\n                </td>\n                <td align=\"left\" valign=\"top\">\n                  <p>20 mg once a day</p>\n                </td>\n                <td align=\"left\" valign=\"top\">\n                  <p>10 mg once a day </p>\n                </td>\n                <td align=\"left\" valign=\"top\">\n                  <p>40 mg once a day</p>\n                </td>\n              </tr>\n              <tr>\n                <td align=\"left\" valign=\"top\">\n                  <p>Pantoprazole</p>\n                </td>\n                <td align=\"left\" valign=\"top\">\n                  <p>40 mg once a day</p>\n                </td>\n                <td align=\"left\" valign=\"top\">\n                  <p>20 mg once a day</p>\n                </td>\n                <td align=\"left\" valign=\"top\">\n                  <p>40 mg twice a day</p>\n                </td>\n              </tr>\n              <tr>\n                <td align=\"left\" valign=\"top\">\n                  <p>Rabeprazole</p>\n                </td>\n                <td align=\"left\" valign=\"top\">\n                  <p>20 mg once a day</p>\n                </td>\n                <td align=\"left\" valign=\"top\">\n                  <p>10 mg once a day</p>\n                </td>\n                <td align=\"left\" valign=\"top\">\n                  <p>20 mg twice a day</p>\n                </td>\n              </tr>\n              <tr>\n                <td align=\"left\" valign=\"top\">\n                  <p>Dexlansoprazole</p>\n                </td>\n                <td align=\"left\" valign=\"top\">\n                  <p>30 mg once a day</p>\n                </td>\n                <td align=\"left\" valign=\"top\">\n                  <p>15 mg once a day</p>\n                </td>\n                <td align=\"left\" valign=\"top\">\n                  <p>30 mg twice a day</p>\n                </td>\n              </tr>\n              <!-- <tr>\n          <td align=\"left\" valign=\"top\">\n            <p>Tenatoprazole</p>\n          </td>\n          <td align=\"left\" valign=\"top\">\n            <p></p>\n          </td>\n          <td align=\"left\" valign=\"top\">\n            <p></p>\n          </td>\n          <td align=\"left\" valign=\"top\">\n            <p></p>\n          </td>\n        </tr>\n        <tr>\n          <td align=\"left\" valign=\"top\">\n            <p>Ilaprazole</p>\n          </td>\n          <td align=\"left\" valign=\"top\">\n            <p></p>\n          </td>\n          <td align=\"left\" valign=\"top\">\n            <p></p>\n          </td>\n          <td align=\"left\" valign=\"top\">\n            <p></p>\n          </td>\n        </tr> -->\n            </tbody>\n          </table>\n\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"headingFour\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapseFour\" aria-expanded=\"false\" aria-controls=\"collapseFour\">\n            <span class=\"increment_number\"></span> What if PPIs don\u2019t work for me?\n          </a>\n          <span class=\"opinion\">my opinion</span>\n        </h5>\n      </div>\n\n      <div id=\"collapseFour\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFour\">\n        <div>\n          <span class=\"url\">URL</span>\n        </div>\n        <div class=\"card-block\">\n          If one of your PPI does not work, you should try another PPI brand and so on until you find the \u201Cperfect\u201D one. Also try H2\n          blockers. If you haven\u2019t managed your diet then do so. Eliminate certain foods (lactose, gluten, carbs, fizzy\n          drinks, junk food etc.) and see if that helps. If none of this helps then visit your MD. The last resort would\n          be an esophageal surgery (Nissen fundoplication and other related procedures). Make sure you try everything\n          else before surgery.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"headingFive\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapseFive\" aria-expanded=\"false\" aria-controls=\"collapseFive\">\n            <span class=\"increment_number\"></span> When is the best time to take PPIs?\n          </a>\n          <span class=\"knowledge\">knowledge</span>\n        </h5>\n      </div>\n\n      <div id=\"collapseFive\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingFive\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"https://www.researchgate.net/post/What_is_the_best_time_to_take_omeprazol\" class=\"url\" target=\"_blank\">#1</a>\n          <a href=\"http://www.webmd.com/heartburn-gerd/proton-pump-inhibitors-for-gastroesophageal-reflux-disease-gerd\" class=\"url\"\n            target=\"_blank\">#2</a>\n        </div>\n        <div class=\"card-block\">\n          Proton pump inhibitors work best when they are taken 30 minutes before your first meal of the day (morning meal). If taking\n          one pill before your first meal does not completely relieve your symptoms, talk to your doctor about taking\n          another pill before your evening meal. If you are taking the evening pill, then you should take it 30 minutes\n          before the evening meal.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"headingSix\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapseSix\" aria-expanded=\"false\" aria-controls=\"collapseSix\">\n            <span class=\"increment_number\"></span> What is the best and most effective PPI brand? (nexium, dexilant, protonix etc.)?\n          </a>\n          <span class=\"opinion\">my opinion</span>\n        </h5>\n      </div>\n\n      <div id=\"collapseSix\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingSix\">\n        <div>\n          <span>URL</span>\n\n        </div>\n        <div class=\"card-block\">\n          There isn\u2019t the best brand in terms of PPIs. All PPI brands work the same, by inhibiting the little pumps in our stomach\n          and therefore allowing our stomach/esophagus to heal over time. Other types of PPIs have been compared to omeprazole\n          (the first PPI type) and no one showed any significant difference in terms of being the best. The newer PPI\n          (esomeprazole-nexium) also does not show any significant difference compared to omeprazole (prilosec). Dexlansoprazole\n          which was approved by the FDA in 2009 (Kapidex, Dexilant). Showed a little advatanges when compared to esomeprazole\n          but again, no significant difference.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"headingSeven\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapseSeven\" aria-expanded=\"false\"\n            aria-controls=\"collapseSeven\">\n            <span class=\"increment_number\"></span> How long do PPIs stay in your system (body)?\n          </a>\n          <span class=\"knowledge\">knowledge</span>\n        </h5>\n\n      </div>\n\n      <div id=\"collapseSeven\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingSeven\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"https://en.wikipedia.org/wiki/Proton-pump_inhibitor\" class=\"url\" target=\"_blank\">#1</a>\n          <a href=\"http://www.justanswer.com/medical/97254-long-does-nexium-a-ppi-stay-urine-continuous.html\" class=\"url\" target=\"_blank\">#2</a>\n        </div>\n        <div class=\"card-block\">\n          The half-life of PPIs inhibition of gastric acid secretion lasts an estimated 24 hours. The half-life in the blood is 1-1.5\n          hours. The PPI should get out of your system in less than a week because it takes 4 half-life\u2019s to eliminate\n          the PPI from the body.\n          <p></p>\n          <b>Half-life</b>: action duration of a drug.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"headingEight\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapseEight\" aria-expanded=\"false\"\n            aria-controls=\"collapseEight\">\n            <span class=\"increment_number\"></span> Can I use PPIs indefinitely (every day or so)?\n          </a>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapseEight\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"headingEight\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"http://www.askdoctork.com/okay-take-ppi-heartburn-indefinitely-201605239171\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          As often said, no drug is 100% safe. That doesn\u2019t mean that you shouldn\u2019t take one if you need it. But you should continually\n          weigh the risks and benefits. </br>\n          Many people take PPIs. People often take PPIs every day for years. This makes sense if you have a chronic problem with stomach\n          acid, a severe case of Barrett\u2019s esophagus, Zollinger-Ellison syndrome etc., but the occasional case of mild\n          heartburn does not need to be treated with a PPI. </br>\n          <p></p>\n          If you have a prescription for a PPI, you and your doctor should review the reasons for it periodically to make sure they\u2019re\n          still valid. If you do need that prescription and many people do it should be for the lowest effective dose.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading9\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse9\" aria-expanded=\"false\" aria-controls=\"collapse9\">\n            <span class=\"increment_number\"></span> Are PPIs addictive, If yes why?\n          </a>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse9\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading9\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"http://www.ehealthme.com/ds/omeprazole/addiction/\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          There is no Addiction reported by people who take Omeprazole (PPI) yet. This review analyzes which people have Addiction\n          with Omeprazole. It is created by eHealthMe based on reports from FDA, and is updated regularly.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading10\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse10\" aria-expanded=\"false\" aria-controls=\"collapse10\">\n            <span class=\"increment_number\"></span> Are PPIs generally well tolerated?\n          </a>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse10\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading10\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC3171810/\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          Long-term studies have shown that PPIs are generally well tolerated and cause few adverse events. As a class, however, PPIs\n          are associated with an increased risk of certain diseases.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading11\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse11\" aria-expanded=\"false\" aria-controls=\"collapse11\">\n            <span class=\"increment_number\"></span> PPIs and drug interactions?\n          </a>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse11\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading11\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"https://www.ncbi.nlm.nih.gov/pubmed/20608754\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          Because PPIs give rise to profound and long-lasting elevation of intragastric pH, it is not surprising that they interfere\n          with the absorption of concurrent medications. PPIs have been shown to reduce the bioavailability of many clinically\n          relevant drugs (e.g. ketoconazole, atazanavir) by 50% or more compared with the control values. Omeprazole\n          was associated with 30% and 10% reductions in systemic clearance of diazepam and phenytoin. Clinical trials\n          have raised concerns about possible interactions between PPIs and clopidogrel. It has been suggested that therapy\n          consisting of clopidogrel and aspirin may attenuate the anti-aggregation effects of those medications and augment\n          the risk of cardiovascular ischemic events.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading12\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse12\" aria-expanded=\"false\" aria-controls=\"collapse12\">\n            <span class=\"increment_number\"></span> In which part of the body are PPIs absorbed?\n          </a>\n          <span class=\"knowledge\">knowledge</span>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse12\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading12\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC2266058/\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          Initially absorbed in the small intestine and distributed to the gastric parietal cells, where they are activated in the\n          acidic environment of their acidic vesicles and secretory canaliculi. (pH\n          < 1) is reportedly necessary for the activation of PPIs, thus it has been believed that parietal cells are the only sites\n            in the human body in which PPIs are activated. However, cells such as leukocytes and osteoclasts are also known\n            to have acidic vesicles in their cytoplasm. If PPIs indeed exerted effects on the functions of these cells,\n            additional interesting therapeutic possibilities may be revealed for PPIs. However, we would also need to pay\n            attention to the adverse effects of long-term and high-dose PPI therapy. <p>\n            </p>\n            vesicles: a small fluid-filled bladder, sac in the body.\n            <p></p>\n            canaliculi: microscopic canals/tubes\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading13\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse13\" aria-expanded=\"false\" aria-controls=\"collapse13\">\n            <span class=\"increment_number\"></span> Where are proton pumps found?\n          </a>\n          <span class=\"knowledge\">knowledge</span>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse13\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading13\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"https://en.wikipedia.org/wiki/Proton_pump\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          A proton pump is an integral membrane protein that is capable of moving protons across a biological membrane. In cell respiration.\n          The proton pump uses energy to transport protons from the matrix of the mitochondrion to the inter-membrane\n          space. The proton pump does not create energy, but forms a gradient that stores energy for later use. In addition\n          to proton pumps in mitochondria, humans have a gastric hydrogen potassium ATPase or H+/K+ ATPase that functions\n          as the proton pump of the stomach, primarily responsible for making the stomach acidic.\n          <p></p>\n          Mitochondrion: a powerhouse in a cell in which the biochemical processes of respiration and energy production occur.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading14\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse14\" aria-expanded=\"false\" aria-controls=\"collapse14\">\n            <span class=\"increment_number\"></span> Do PPIs shut down all the proton pumps in our body (not just stomach proton pumps)?\n          </a>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse14\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading14\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"http://www.webmd.com/heartburn-gerd/news/20160608/proton-pump-inhibitor-health-risks#1\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          The drugs don\u2019t just turn off acid pumps in the stomach. Instead, the researchers say, PPIs also block the production of\n          acid in every cell in our bodies, an effect that hampers the body\u2019s ability to rid itself of damaged proteins\n          -- the \u201Cgarbage\u201D that builds up as we age. \u201CI think we now have a smoking gun,\u201D says John Cooke, MD, PhD\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading15\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse15\" aria-expanded=\"false\" aria-controls=\"collapse15\">\n            <span class=\"increment_number\"></span> Do I have to take PPIs when using NSAIDs?\n          </a>\n          <span class=\"knowledge\">knowledge</span>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse15\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading15\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"http://www.webmd.com/rheumatoid-arthritis/features/anti-inflammatory-drugs-rheumatoid-arthritis#2\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          Unfortunately, there can be a downside to such medication (NSAIDs): stomach upset and bleeding ulcers. The most popular generic\n          NSAIDs include: naproxen, ibuprofen, aspirin etc. \"If you're taking NSAIDs on a\n          <b>chronic basis</b>, there's a very high percentage risk that you will develop significant symptoms,\" says Hoffman.\n          Taking a second drug can reduce your risk of side effects related to traditional NSAIDs, says Hoffman. Among\n          the options: an acid-blocking drug like PPI or a less potent drug like H2 blocker. Also you could try an ulcer\n          protective drug: Cytotec.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading16\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse16\" aria-expanded=\"false\" aria-controls=\"collapse16\">\n            <span class=\"increment_number\"></span> How much stomach acid do PPIs eliminate/shut down?\n          </a>\n          <span class=\"knowledge\">knowledge</span>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse16\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading16\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"https://en.wikipedia.org/wiki/Proton-pump_inhibitor\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          Proton pump inhibitors act by irreversibly blocking the acid producing pumps in the stomach. Targeting the terminal step\n          in acid production, as well as the irreversible nature of the inhibition, results in a class of drugs that\n          are significantly more effective than H2 antagonists and reduce gastric acid secretion by up to 99%. Depends\n          on the dosage.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading17\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse17\" aria-expanded=\"false\" aria-controls=\"collapse17\">\n            <span class=\"increment_number\"></span> Why PPIs are called powerful drugs?\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse17\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading17\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC2266058/\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          Often referred as to \u201CBig guns\u201D the PPIs are currently the most effective drugs on the market. They are more effective than\n          H2 blockers and allow the duodenum, stomach and esophagus lining to heal more quickly only by suppressing the\n          stomach acid which is highly corrosive by its nature.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading18\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse18\" aria-expanded=\"false\" aria-controls=\"collapse18\">\n            <span class=\"increment_number\"></span> Are PPIs more efficient than H2 blockers?\n          </a>\n          <span class=\"knowledge\">knowledge</span>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse18\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading18\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC4493004/\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          In conclusion, PPIs were superior to H2RAs in preventing LDA-associated GI ulcers/erosions and bleeding. Some of the RCTs\n          included in our meta-analysis were poorly reported and of low quality, therefore, our meta-analysis should\n          be interpreted with caution. More multicenter, high-quality RCTs are needed to compare two anti-secretory drugs\n          for prevention of LDA-associated GI injuries.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading19\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse19\" aria-expanded=\"false\" aria-controls=\"collapse19\">\n            <span class=\"increment_number\"></span> Which patients should not take PPIs constantly?\n          </a>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse19\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading19\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"https://patient.info/health/proton-pump-inhibitors\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          PPIs may not be suitable for some people - for example, people with certain liver problems. Breast-feeding or pregnant mums\n          should avoid them apart from omeprazole which is deemed to be safe. A full list of individuals who should not\n          take a PPI is included with the information leaflet that comes in the medicine packet. If you are prescribed\n          or buy a PPI, read this to be sure you are safe to take it. Also, patients who have occasional heartburn or\n          stomach discomfort should not be on PPIs, they can manage their condition whith diet or a less potent drug.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_1\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_1\" aria-expanded=\"false\" aria-controls=\"collapse_1\">\n            <span class=\"increment_number\"></span> Why can\u2019t pregnant woman take PPIs in early pregnancy, what should they take instead?\n          </a>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_1\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_1\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"http://www.webmd.com/baby/news/20101124/acid-reducing-drugs-may-not-be-risky-in-pregnancy#1\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          The popular over-the-counter and prescription acid-blocking drugs proton-pump inhibitors (PPIs) do not appear to increase\n          risk of birth defects when taken during the first trimester of pregnancy, a study shows.\n          <p></p>\n          In the study, 2.6% of more than 840,000 live births occurring in Denmark from January 1996 through September 2008 involved\n          major birth defects. The study showed that 3.4% of 5,082 infants whose mothers took PPIs during the four weeks\n          before conception through first trimester were diagnosed with a major birth defect. By contrast, 2.6% of 835,886\n          infants whose moms did not take these acid-reducing drugs during the same time period were diagnosed with a\n          major birth defect.\n          </p>\n          </p>\n          The study is published in the New England Journal of Medicine. The researchers did an analysis of the study data on PPI use\n          limited to the time period during the first trimester of pregnancy. Statistically speaking, there was no significant\n          increased risk of birth defects seen among children of women who took PPIs -- including Aciphex, Nexium, Prevacid,\n          Prilosec, and Protonix -- during their first trimester of pregnancy compared with women who did not take these\n          drugs during the first trimester of pregnancy.\n          <p> </p>\n          \u201CWe found no significant association between the use of PPIs during the first trimester of pregnancy and the risk of major\n          birth defects,\u201D conclude study researchers Bj\xF6rn Pasternak, MD, PhD and Anders Hviid of Statens Serum Institut\n          in Copenhagen, Denmark.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading20\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse20\" aria-expanded=\"false\" aria-controls=\"collapse20\">\n            <span class=\"increment_number\"></span> Can I buy PPIs over the counter (OTC, without prescription)? If yes in which dosage?\n          </a>\n          <span class=\"opinion\">my opinion</span>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse20\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading20\">\n        <div>\n          <span class=\"\">URL</span>\n        </div>\n        <div class=\"card-block\">\n          Most of these medicines are prescription only. You can buy omeprazole and pantoprazole over-the-counter at pharmacies. However,\n          if you need to use this medicine for more than 4 weeks you should consult your doctor. There is a ongoing debate\n          from doctors that this medicine should not be OTC (over the counter), it should only be given by prescription.\n          <p></p>\n          In Croatia you can buy pantoprazole 20mg OTC, without prescription.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading21\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse21\" aria-expanded=\"false\" aria-controls=\"collapse21\">\n            <span class=\"increment_number\"></span> Is there anything stronger than PPIs, better, something that lasts more?\n          </a>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse21\" class=\"collapse \" role=\"tabpanel\" aria-labelledby=\"heading21\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"https://www.ncbi.nlm.nih.gov/pmc/articles/PMC3895610/\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          PPIs have remained the mainstay of treatment in GERD patients. Drug development in GERD has considerably slowed down as most\n          PPIs became generic and were then available over the counter. However, there are still many areas of unmet\n          need in GERDs, so new therapies are needed. Current compounds under development include improved PPIs (dexlansoprazole,\n          tenatoprazole-clinical trial, ilaprazole-clinical trial), TLESR reducers, esophageal-specific pain modulators,\n          and mucosal protectants.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading22\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse22\" aria-expanded=\"false\" aria-controls=\"collapse22\">\n            <span class=\"increment_number\"></span> Are PPIs toxic?\n          </a>\n          <span class=\"opinion\">my opinion</span>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse22\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading22\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"http://www.medscape.com/viewarticle/876199\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          I've read on forums that PPIs are not toxic but a doctor (David Jacobson) at Medscape said (year 2017) that they are probably\n          more harmful then steroids (gaining quite a few up votes on his comment). Quote: \u201CThis class of medication\n          is probably more dangerous than steroids, but most docs dispense it like Pez. Cellular modifying drugs should\n          be used as a last resort\u201D. Still, if they are FDA approved and used by millions of patients from all around\n          the world, then PPI should be quite safe.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading23\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse23\" aria-expanded=\"false\" aria-controls=\"collapse23\">\n            <span class=\"increment_number\"></span> Can I open the tablets and dissolve the powder with water?\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse23\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading23\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"http://www.medicinesforchildren.org.uk/omeprazole-gastro-oesophageal-reflux-disease-gord\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          Put the tablet in 10 mL of water (two medicine spoons) \u2013 do not crush the tablets. (Tablets may be split in half if the dose\n          is half of the full tablet.) Stir gently until a very cloudy mixture is created, this may take 5\u201310 minutes.\n          You can add a small amount of fruit juice, apple sauce or yogurt to this mixture but do not use milk or fizzy\n          water. Your child should eat/drink all the mixture straight away.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading24\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse24\" aria-expanded=\"false\" aria-controls=\"collapse24\">\n            <span class=\"increment_number\"></span> Do PPIs form a protective barrier on my stomach lining?\n          </a>\n          <span class=\"noanswer\">noanswer</span>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse24\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading24\">\n        <div>\n          <span class=\"\">URL</span>\n\n        </div>\n        <div class=\"card-block\">\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading25\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse25\" aria-expanded=\"false\" aria-controls=\"collapse25\">\n            <span class=\"increment_number\"></span> How long should I be PPI free before having an endoscopy procedure?\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse25\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading25\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"https://patient.info/forums/discuss/omeprazole-and-acid-reflux-37519\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          The advice regarding withholding proton pump inhibitors (such as omeprazole) for at least 2 weeks before endoscopy is common\n          but you'll need to discuss with your GP about whether you can still take it before the procedure or any other\n          antacid medication such as gaviscon. (hospital pharmacist)\n        </div>\n      </div>\n    </div>\n    <h3 id=\"condition_heading\" style=\"color:#f42d2d;\">Condition</h3>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading26\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse26\" aria-expanded=\"false\" aria-controls=\"collapse26\">\n            <span class=\"increment_number\"></span> For which diseases are PPIs used?\n            <span class=\"knowledge\">knowledge</span>\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse26\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading26\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"https://en.wikipedia.org/wiki/Proton-pump_inhibitor\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          These drugs are used in the treatment of many conditions, such as:\n          <ul>\n            <li> Dyspepsia </li>\n            <li>Peptic ulcer disease including after endoscopic treatment for bleeding</li>\n            <li>As part of Helicobacter pylori eradication therapy</li>\n            <li>Gastroesophageal reflux disease (GERD or GORD) including symptomatic endoscopy-negative reflux disease and\n              associated laryngopharyngeal reflux causing laryngitis and chronic cough</li>\n            <li>Barrett's esophagus</li>\n            <li>Eosinophilic esophagitis</li>\n            <li> Stress gastritis and ulcer prevention in critical care</li>\n            <li>Gastrinomas and other conditions that cause hypersecretion of acid including Zollinger\u2013Ellison syndrome (often\n              2\u20133x the regular dose is required)</li>\n          </ul>\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_2\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_2\" aria-expanded=\"false\" aria-controls=\"collapse_2\">\n            <span class=\"increment_number\"></span> What is Esophagitis?\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_2\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_2\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"http://www.webmd.com/digestive-disorders/esophagitis#1\" class=\"url\" target=\"_blank\">#1</a>\n          <a href=\"https://en.wikipedia.org/wiki/Esophagitis\" class=\"url\" target=\"_blank\">#2</a>\n        </div>\n        <div class=\"card-block\">\n          Esophagitis is an inflammation of the lining of the esophagus. If left untreated, it can become very uncomfortable, causing\n          problems with swallowing, ulcers and scarring of the esophagus. In some instances, a condition known as Barrett's\n          esophagus may develop, which increases the risk for esophageal cancer.\n          <p></p>\n          The severity of reflux esophagitis is commonly classified into 4 grades according to the Los Angeles Classification\n        </div>\n        <table class=\"wikitable\" border=\"1\" style=\"margin:15px\">\n          <tr>\n            <td>\n              <b>Grade A</b>\n            </td>\n            <td>One or more mucosal breaks &lt; 5&#160;mm in maximal length</td>\n          </tr>\n          <tr>\n            <td>\n              <b>Grade B</b>\n            </td>\n            <td>One or more mucosal breaks &gt; 5mm, but without continuity across mucosal folds</td>\n          </tr>\n          <tr>\n            <td>\n              <b>Grade C</b>\n            </td>\n            <td>Mucosal breaks continuous between &gt; 2 mucosal folds, but involving less than 75% of the esophageal circumference</td>\n          </tr>\n          <tr>\n            <td>\n              <b>Grade D</b>\n            </td>\n            <td>Mucosal breaks involving more than 75% of esophageal circumference</td>\n          </tr>\n        </table>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_3\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_3\" aria-expanded=\"false\" aria-controls=\"collapse_3\">\n            <span class=\"increment_number\"></span> What is Duodenitis?\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_3\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_3\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"http://sussexsurgical.co.uk/information.php?t=Duodenitis&id=101\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          Inflammation within the duodenum or duodenitis is a common diagnosis, which is reducing with the use of drugs for symptoms\n          of \u201Cindigestion\u201D which drastically suppress stomach acid production.\n          <p></p>\n          It is caused by a bacterial infection or particular types of painkilling drugs has also changed the nature of the condition\n          in the UK in the last twenty years.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_4\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_4\" aria-expanded=\"false\" aria-controls=\"collapse_4\">\n            <span class=\"increment_number\"></span> What is Bulbitis?\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_4\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_4\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"http://medical-dictionary.thefreedictionary.com/peptic+bulbitis\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          A condition caused by chronic exposure to excess hydrochloric acid, which is characterised by inflammation, and most prominent\n          in the duodenal bulb (D1), associated with Helicobacter pylori infection, chronic active gastritis and peptic\n          ulcer disease. Peptic duodenitis is at the banal end of the spectrum of upper GI inflammation, at the other\n          end of which is peptic ulcer disease.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_5\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_5\" aria-expanded=\"false\" aria-controls=\"collapse_5\">\n            <span class=\"increment_number\"></span> What is a Hiatal Hernia?\n            <span class=\"knowledge\">knowledge</span>\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_5\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_5\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"http://www.healthline.com/health/hiatal-hernia#types-of-hiatal-hernia\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          A hiatal hernia occurs when the upper part of your stomach pushes up through your diaphragm into your chest region.\n          <p></p>\n          This condition mostly occurs in people who are over 50 years of age. It affects up to 60 percent of people by the time they\n          reach 60, according to the Esophageal Cancer Awareness Association.\n          <p></p>\n          The exact cause of many hiatal hernias is unknown. In some people, injury or other damage may weaken muscle tissue. This\n          makes it possible for your stomach to push through your diaphragm. Another cause is putting too much pressure\n          (constantly) on the muscles around your stomach. This can happen when you:\n          <ul>\n            <li>cough</li>\n            <li>vomit</li>\n            <li>strain during bowel movements</li>\n            <li>lift heavy objects</li>\n          </ul>\n          Some people are also born with an abnormally large hiatus. This makes it easier for the stomach to move through it. Factors\n          that can increase your likelihood of developing a hiatal hernia are:\n          <ul>\n            <li>obesity</li>\n            <li>aging</li>\n            <li>smoking</li>\n          </ul>\n          Types of hiatal hernia:\n          <b>slided</b>-common and\n          <b>fixed</b>-uncommon.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_6\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_6\" aria-expanded=\"false\" aria-controls=\"collapse_6\">\n            <span class=\"increment_number\"></span> What is a strangulated Hiatal Hernia?\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_6\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_6\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"https://www.drugs.com/health-guide/hiatal-hernia.html\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          In some cases, a paraesophageal hernia may slide into the chest and become trapped and unable to slide back into the abdomen.\n          If this happens, there is a danger that the trapped hernia may die because its blood supply is cut off (strangulated).\n          Symptoms of a strangulated hiatal hernia include sudden severe chest pain and difficulty swallowing. Such situation\n          requires immediate medical treatment.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_005\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_005\" aria-expanded=\"false\" aria-controls=\"collapse_005\">\n            <span class=\"increment_number\"></span> Strangulated hernia, what are the main symptoms?\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_005\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_005\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"https://www.hernia.org/types/strangulated-hernia/\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          <ul>\n            <li>Sharp or Severe pain</li>\n            <li>Vomiting</li>\n            <li>Blood in Excrement</li>\n            <li>Constipation</li>\n            <li>Malaise with or without a fever</li>\n            <li>A burning or hot sensation around the hernia</li>\n          </ul>\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_008\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_008\" aria-expanded=\"false\" aria-controls=\"collapse_008\">\n            <span class=\"increment_number\"></span> How common is a strangulated hernia?\n            <span class=\"opinion\">my opinion</span>\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_008\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_008\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"https://www.drugs.com/health-guide/hiatal-hernia.html\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n\n            I once came across a scientific paper (cannot find it anymore) which described an older woman in her seventies who came to\n            the hospital because of chest pain. She had a strangulate hiatal hernia.<p></p>\n\n            I could not find any forum neither a website or any other real-life source where someone mentions a strangulated\n            hiatal hernia. Thereby, we can conclude that this condition happens rarely.\n          <p></p>\n          If you really had a strangulated hernia you would be in extreme pain and would have noticeable symptoms.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_7\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_7\" aria-expanded=\"false\" aria-controls=\"collapse_7\">\n            <span class=\"increment_number\"></span> What is Achalasia?\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_7\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_7\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"http://www.medicinenet.com/achalasia/article.htm\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          Achalasia is a rare disease of the muscle of the lower esophageal body and the lower esophageal sphincter that prevents relaxation\n          of the sphincter and an absence of contractions, or peristalsis, of the esophagus.\n          <p></p>\n          The cause of achalasia is unknown. However, there is degeneration of the esophageal muscles and more importantly, the nerves\n          that control the muscles.\n          <p></p>\n          <b>Common symptoms</b> of achalasia include: difficulty in swallowing (dysphagia), chest pain, and regurgitation\n          of food and liquids.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_8\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_8\" aria-expanded=\"false\" aria-controls=\"collapse_8\">\n            <span class=\"increment_number\"></span> What is LPR (Laryngopharyngeal reflux), is it often called the silent reflux?\n            <span class=\"knowledge\">knowledge</span>\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_8\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_8\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"https://en.wikipedia.org/wiki/Laryngopharyngeal_reflux\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          Laryngopharyngeal reflux (LPR), also extraesophageal reflux disease (EERD) refers to the flow of gastric contents to the\n          <b>upper aero-digestive tract</b>, which causes a variety of symptoms, such as cough, hoarseness, and wheezing,\n          among others. Although heartburn is a primary symptom among people with gastroesophageal reflux disease (GERD),\n          heartburn is present in fewer than 50% of the patients with LPR. Other terms used to describe this condition\n          include atypical reflux, silent reflux, and supra-esophageal reflux.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_9\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_9\" aria-expanded=\"false\" aria-controls=\"collapse_9\">\n            <span class=\"increment_number\"></span> What is bile reflux?\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_9\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_9\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"http://www.mayoclinic.org/diseases-conditions/bile-reflux/basics/definition/con-20025548\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          Bile reflux occurs when bile which is a digestive liquid produced in your liver backs up (refluxes) into your stomach and\n          the tube that connects your mouth and stomach (esophagus). Bile reflux may come with acid reflux, but they\n          are 2 separate conditions. Whether bile is important in reflux is controversial. Bile is often a suspected\n          cause of reflux when people respond incompletely or not at all to acid supressing drugs.\n          <p></p>\n          Unlike acid reflux, bile reflux usually can't be completely controlled by changes in diet or lifestyle. Treatment involves\n          medications or, in severe cases, surgery.\n          <p></p>\n          Bile and acid reflux are both needed for formation of Barrett\u2019s esophagus.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_10\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_10\" aria-expanded=\"false\" aria-controls=\"collapse_210\">\n            <span class=\"increment_number\"></span> What is Zollinger-Ellison syndrome, is it rare?\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_10\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_10\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"http://www.mayoclinic.org/diseases-conditions/zollinger-ellison-syndrome/basics/definition/con-20024097\" class=\"url\"\n            target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          Zollinger-Ellison syndrome is a rare condition in which 1 or more tumors form in your pancreas or the upper part of your\n          small intestine (duodenum). These tumors, called gastrinomas, secrete large amounts of the hormone gastrin,\n          which causes your stomach to produce too much acid. The excess acid causes peptic ulcers, as well as diarrhea\n          and other symptoms.\n          <p></p>\n          Zollinger-Ellison syndrome (ZES) is rare. The disease may occur at any time in life, but people are usually diagnosed between\n          ages 20 and 50. Medications to reduce stomach acid (PPIs) and heal the ulcers is the standard treatment for\n          this condition.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_11\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_11\" aria-expanded=\"false\" aria-controls=\"collapse_11\">\n            <span class=\"increment_number\"></span> What is the difference between acute, chronic and atrophic gastritis?\n          </a>\n          <span class=\"opinion\">my opinion</span>\n          <span class=\"knowledge\">knowledge</span>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_11\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_11\">\n        <div>\n          <span class=\"\">URL</span>\n          <!-- <a href=\"https://en.wikipedia.org/wiki/Proton-pump_inhibitor\" class=\"url\" target=\"_blank\">#1</a> -->\n        </div>\n        <div class=\"card-block\">\n          Acute gastritis is a sudden inflammation of the stomach lining often caused by: H. pylori, NSAID or corticosteroid usage,\n          excessive alcohol consumption or other.\n          <p></p>\n          Chronic gastritis represents chronic/long lasting inflammation of the stomach lining caused by: longterm NSAID or corticosteroids\n          usage, H. pylori infection, long lasting/chronic stress or other.\n          <p></p>\n          Atrophic gastritis is a chronic inflammation of the stomach mucosa, where gastric glandular cells get replaced by intestinal\n          and fibrous tissues. It is caused by: long-term H. pylori infection or can appear as autoimmune disease.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_12\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_12\" aria-expanded=\"false\" aria-controls=\"collapse_12\">\n            <span class=\"increment_number\"></span> How long does it take to develop cancer from atrophic gastritis?\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_12\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_12\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"https://en.wikipedia.org/wiki/Atrophic_gastritis\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          Patients with atrophic gastritis have an increased risk for the development of gastric adenocarcinoma (cancer). The optimal\n          endoscopic surveillance strategy is unknown but all nodules and polyps should be removed in these patients.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_13\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_13\" aria-expanded=\"false\" aria-controls=\"collapse_13\">\n            <span class=\"increment_number\"></span> What does an erosive stomach/esophagus lining mean?\n          </a>\n          <span class=\"opinion\">my opinion</span>\n          <span class=\"knowledge\">knowledge</span>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_13\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_13\">\n        <div>\n          <span class=\"\">URL</span>\n          <!-- <a href=\"\" class=\"url\" target=\"_blank\">#1</a> -->\n        </div>\n        <div class=\"card-block\">\n          Erosive lining in general means that you have a small internal bleeding inside your esophagus/stomach. After the mucosa breaks,\n          the stomach acid can easily digest your lining and therefore usually causes small amounts of blood visible\n          on the lining. If left untreated, the erosive gastritis usually progresses to ulcers or even more bleeding\n          which can be fatal.\n          <p></p>\n          For such condition, PPIs are prescribed for 4-8 weeks daily (dosage depends on the severity of the erosions). Althought this\n          condition sounds scary, for most patients, medications allows the lining to heal in a short period of time.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading27\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse27\" aria-expanded=\"false\" aria-controls=\"collapse27\">\n            <span class=\"increment_number\"></span> Do PPIs cause gastroparesis?\n          </a>\n          <span class=\"opinion\">my opinion</span>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse27\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading27\">\n        <div>\n          <span class=\"\">URL</span>\n\n        </div>\n        <div class=\"card-block\">\n          Gastroparesis represents a condition where stomach emptying is delayed due to the vagus nerve damage. The never makes the\n          stomach motility muscles malfunctioning therefore causing delayed stomach content emptying. Few people report\n          having Gastroparesis due to PPIs and there isn\u2019t a strong connection that PPIs could cause such condition.\n          The medication often used for such condition is domperidone (generic) often sold by the brand motilium.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading28\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse28\" aria-expanded=\"false\" aria-controls=\"collapse28\">\n            <span class=\"increment_number\"></span> Do PPIs cause gallbladder problem?\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse28\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading28\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"https://www.ncbi.nlm.nih.gov/pubmed/16858534\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          In the authors' previous study of gallbladder function before and after fundoplication, 58% of the patients demonstrated\n          preoperative gallbladder motor dysfunction, and 86% of those retested after operation and cessation of proton\n          pump inhibitors (PPIs) normalized. Short-term PPI therapy reduces gallbladder motility in healthy volunteers.\n          Chronic PPI therapy may pose a risk for long-term gallbladder dysfunction and biliary complications.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading29\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse29\" aria-expanded=\"false\" aria-controls=\"collapse29\">\n            <span class=\"increment_number\"></span> Do PPIs cause C. difficile?\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse29\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading29\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"https://www.ncbi.nlm.nih.gov/pubmed/25730198\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          After adjustment for other independent predictors of recurrence, patients with continuous PPI use remained at elevated risk\n          of CDI recurrence. We suggest that the cessation of unnecessary PPI use should be considered at the time of\n          CDI diagnosis.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading30\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse30\" aria-expanded=\"false\" aria-controls=\"collapse30\">\n            <span class=\"increment_number\"></span> Do PPIs cause Pneumonia?\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse30\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading30\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"http://www.medscape.com/viewarticle/773588_4\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          In conclusion, our results suggest that PPI therapy is associated with an approximately 2 times increased risk of developing\n          pneumonia possibly as a result of the endogenous oropharyngeal flora. In particular we found a significantly\n          increased association between PPI use and S. pneumoniae pneumonia. It should be reminded that, in line with\n          previous observational studies, the association between PPI use and adverse events may be due to confounding,\n          with PPI use more of a marker for, than a cause of, higher rates of CAP due to S. pneumoniae. Therefore further\n          studies are required to delineate the exact pathophysiologic mechanisms relating PPI usage to respiratory infection.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading31\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse31\" aria-expanded=\"false\" aria-controls=\"collapse31\">\n            <span class=\"increment_number\"></span> Do PPIs cause magnesium, calcium, vitamin, B12, iron deficiencies (mineral, vitamin) when taken long-term?\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse31\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading31\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"http://www.ancient-minerals.com/magnesium-sources/absorption/\" class=\"url\" target=\"_blank\">#1</a>\n          <a href=\"https://www.ncbi.nlm.nih.gov/pubmed/12520541 \" class=\"url\" target=\"_blank\">#2</a>\n          <a href=\"http://www.msdmanuals.com/home/disorders-of-nutrition/vitamins/vitamin-b-12\" class=\"url\" target=\"_blank\">#3</a>\n          <a href=\"http://www.irondisorders.org/absorption/\" class=\"url\" target=\"_blank\">#4</a>\n        </div>\n        <div class=\"card-block\">\n          Let\u2019s says something about absorption first.\n          <p></p>\n          <b>Magnesium:</b> typical magnesium absorption involves: 40% of magnesium intake absorbed in the small intestine\n          5% absorbed in the large intestine 55% leaving the body as waste\n          <p></p>\n          <b>Calcium</b> is absorbed in the mammalian small intestine by two general mechanisms: a transcellular active\n          transport process, located largely in the duodenum and upper jejunum; and a paracellular, passive process that\n          functions throughout the length of the intestine\n          <p></p>\n          <b>Vitamin B12</b> is readily absorbed in the last part of the small intestine (ileum), which leads to the large\n          intestine. However, to be absorbed, the vitamin must combine with intrinsic factor, a protein produced in the\n          stomach.\n          <p></p>\n          <b>Iron:</b> the portion of the small intestine called the duodenum is the chief area where iron absorption takes\n          place. There may be a second minor absorption site near the end of the small intestinal tract. Once iron is\n          absorbed it is carried (transported) by a protein called transferrin.\n          <p></p>\n          All of the vitamin, minerals deficiencies (mentioned above) have been associated with the use of PPIs in some patients, especially\n          patients who have been on higher PPI dosages for a prolonged period of time. Patient on a long-term PPI therapy\n          should get their blood sample checked for Mg, Ca, B12, Fe and if they are low on any of this vitamin, minerals\n          they should increase their intake and/or change the dosage, drug for some period of time but the first thing\n          to do is to talk to your Doctor.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading32\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse32\" aria-expanded=\"false\" aria-controls=\"collapse32\">\n            <span class=\"increment_number\"></span> Do PPIs cause osteoporosis?\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse32\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading32\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"https://www.ncbi.nlm.nih.gov/pubmed/27224743\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          The use of PPIs is a risk factor for development of osteoporosis and osteoporotic fractures. However, as the direct pathogenesis\n          remains unclear, specific points of intervention are lacking, other than being vigilant in regard to the indication\n          for prescribing PPIs and to use the lowest effective dose where PPIs cannot be avoided.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading33\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse33\" aria-expanded=\"false\" aria-controls=\"collapse33\">\n            <span class=\"increment_number\"></span> Do PPIs cause heart problems and heart attack?\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse33\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading33\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"http://www.webmd.com/heartburn-gerd/news/20150610/popular-heartburn-meds-linked-to-higher-risk-of-heart-attack#1\"\n            class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          People who use certain heartburn drugs for a long period of time may have a slightly heightened risk of suffering a heart\n          attack, a new study suggests. Using medical records from nearly 300,000 U.S. adults with acid reflux disease\n          (commonly called heartburn), researchers found that the risk of heart attack was slightly elevated among those\n          using proton pump inhibitors.\n          <p></p>\n          Another class of heartburn drug -- so-called H2-blockers -- was not linked to any increase in heart attack risk, the study\n          authors noted.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading34\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse34\" aria-expanded=\"false\" aria-controls=\"collapse34\">\n            <span class=\"increment_number\"></span> Do PPIs cause brain problems (dementia, cognitive decline)?\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse34\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading34\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"https://www.alzdiscovery.org/cognitive-vitality/blog/proton-pump-inhibitors\" class=\"url\" target=\"_blank\">#1</a>\n          <a href=\"http://www.medscape.com/viewarticle/858909#vp_2\" class=\"url\" target=\"_blank\">#2</a>\n        </div>\n        <div class=\"card-block\">\n          Researchers are not clear on how PPI use might raise dementia risk. Evidence suggests some PPIs may cross the blood\u2013brain\n          barrier and interact with brain enzymes and, in mice, may increase beta amyloid levels in the brain. Although\n          the current study did not include vitamin B12 levels, other research has linked PPI use to vitamin B12 deficiency,\n          which has been shown to be associated with cognitive decline, Dr Haenisch noted.\n          <p></p>\n          The recent study used data from a German health insurance provider of people aged 75 years or older to show that patients\n          who had used PPIs were 44 percent more likely to develop dementia. The same group reported similar results\n          in an earlier study on a different set of elderly Germans. This consistency is marred, however, by a third\n          study from another group of German scientists reporting that the use of PPIs is associated with a 7 percent\n          lower risk of dementia. All of these studies were observational, which makes it hard to draw conclusions. In\n          the recent study, Germans who took PPIs were also more likely to have depression, cardiovascular disease, and\n          polypharmacy (i.e., they were prescribed a lot of drugs). These conditions are all associated with a higher\n          risk of dementia. While the scientists tried to control for these risks in their analysis, it is difficult\n          to be sure that they succeeded without more studies to replicate their results and to look for extra clues\n          in the data like a dose-response relationship, where higher doses of the drugs relate to a higher risk.\n          <P>\n          </p>\n          beta amyloid: amino acids which are involved in Alzheimer's disease.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading35\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse35\" aria-expanded=\"false\" aria-controls=\"collapse35\">\n            <span class=\"increment_number\"></span> Do PPIs cause kidney problems (nephritis, chronic kidney disease)?\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse35\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading35\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"http://www.medscape.com/viewarticle/876199\" class=\"url\" target=\"_blank\">#1</a>\n          <a href=\"http://www.medscape.com/viewarticle/857060\" class=\"url\" target=\"_blank\">#2</a>\n        </div>\n        <div class=\"card-block\">\n          PPIs are associated with increased risk for chronic kidney disease (CKD), according to two population-based analyses published\n          online January 11 in JAMA Internal Medicine. The authors suggest the widely used drugs might be part of the\n          reason CKD prevalence has risen faster than would be expected from the trends in known CKD risk factors, such\n          as diabetes mellitus and hypertension.\n          <p></p>\n          PPI treatment is known to increase the risk for acute interstitial nephritis (AIN) and CKD. However, whether PPI use is tied\n          to a greater risk for chronic kidney damage in the absence of an earlier episode of acute kidney injury (AKI)\n          has been unclear.\n          <p></p>\n          The possible mechanisms tying PPI use with chronic renal damage are also still unclear\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading36\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse36\" aria-expanded=\"false\" aria-controls=\"collapse36\">\n            <span class=\"increment_number\"></span> Do PPIs cause stomach ulcers?\n          </a>\n          <span class=\"opinion\">my opinion</span>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse36\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading36\">\n        <div>\n          <span class=\"\">URL</span>\n\n        </div>\n        <div class=\"card-block\">\n          Some patients do develop stomach ulcers as a side effect because of continuous PPI therapy. This ulcers are not harmful and\n          endoscopy procedures can remove them.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_14\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_14\" aria-expanded=\"false\" aria-controls=\"collapse_14\">\n            <span class=\"increment_number\"></span> What are the signs/symptoms of an ulcer?\n          </a>\n          <span class=\"knowledge\">knowledge</span>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_14\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_14\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"http://www.mayoclinic.org/diseases-conditions/peptic-ulcer/symptoms-causes/dxc-20231407\" class=\"url\" target=\"_blank\">#1</a>\n\n        </div>\n        <div class=\"card-block\">\n          Common symptoms include:\n          <ul>\n            <li>Burning stomach pain</li>\n            <li> Feeling of fullness, bloating or belching</li>\n            <li>Fatty food intolerance</li>\n            <li>Heartburn</li>\n            <li> Nausea</li>\n          </ul>\n\n          Less often, ulcers may cause severe signs or symptoms (bleeding ulcer especially) such as:\n          <ul>\n            <li>Vomiting or vomiting blood \u2014 which may appear red or black</li>\n            <li> Dark blood in stools, or stools that are black or tarry </li>\n            <li>Trouble breathing</li>\n            <li>Feeling faint</li>\n            <li> Nausea or vomiting</li>\n            <li>Unexplained weight loss</li>\n            <li>Appetite changes</li>\n          </ul>\n          <p></p>\n\n          <b>When to see a doctor</b>\n          <br/> See your doctor if you have the severe signs or symptoms listed above. Also see your doctor if over-the-counter\n          antacids and acid blockers relieve your pain but the pain returns.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading37\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse37\" aria-expanded=\"false\" aria-controls=\"collapse37\">\n            <span class=\"increment_number\"></span> Do PPIs cause cancer?\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse37\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading37\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.cochrane.org/CD010623/UPPERGI_effect-of-the-long-term-use-of-proton-pump-inhibitors-on-the-rate-of-pre-cancerous-lesions-in-the-stomach\"\n            class=\"url\" target=\"_blank\">#1</a>\n          <a href=\"http://www.medscape.com/viewarticle/856420\" class=\"url\" target=\"_blank\">#2</a>\n        </div>\n        <div class=\"card-block\">\n          There is no evidence up to this date that PPIs could cause gastric cancer.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading38\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse38\" aria-expanded=\"false\" aria-controls=\"collapse38\">\n            <span class=\"increment_number\"></span> Can PPIs heal/reverse Barrett\u2019s esophagus?\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse38\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading38\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"https://www.gicare.com/diseases/barretts-esophagus/\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          Currently, there are no medications to reverse Barrett\u2019s esophagus. However, it appears that treating the underlying GERD\n          may slow the progress of the disease and prevent complications such as esophagus cancer.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_15\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_15\" aria-expanded=\"false\" aria-controls=\"collapse_15\">\n            <span class=\"increment_number\"></span> What is the Z-line in the lower part of the esophagus?\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_15\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_15\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"http://www.medicinenet.com/barretts_esophagus/page4.htm\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          The junction of the squamous epithelium of the esophagus and the gastric columnar epithelium occurs at the junction of the\n          esophagus and stomach where the lower esophageal sphincter is located. The common border (interface) of these\n          two linings is often referred to as the\n          <b>Z line</b>, because when examined during an endoscopy, it has a zig zag appearance.\n          <p></p>\n          The Z line is the area where Barrett\u2019s cells are usually detected.\n          <p></p>\n\n          If biopsies are taken from patients with GERD who have a normal appearing Z line (no visible evidence of Barrett's esophagus),\n          up to 30% will show the same intestinal type metaplasia as those that are seen in Barrett's esophagus. The\n          presence of metaplasia on a routine biopsy of a normal appearing Z line in GERD should not lead to any change\n          in management.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_16\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_16\" aria-expanded=\"false\" aria-controls=\"collapse_16\">\n            <span class=\"increment_number\"></span> How long does it take to develop cancer from Barrett\u2019s esophagus?\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_16\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_16\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"http://www.aboutgerd.org/barretts-esophagus/faq-about-barretts-esophagus.html\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          If biopsies are taken from patients with GERD who have a normal appearing Z line (no visible evidence of Barrett's esophagus),\n          up to 30% will show the same intestinal type metaplasia as those that are seen in Barrett's esophagus. The\n          presence of metaplasia on a routine biopsy of a normal appearing Z line in GERD should not lead to any change\n          in management.\n          <p></p>\n          Patients with Barrett\u2019s esophagus should be enrolled in a surveillance program to look for signs of abnormal tissue (dysplasia)\n          or cancer. This is a very slow growing cancer and endoscopies are usually done every 3 years. Patients with\n          esophagitis should have a repeat endoscopy to demonstrate healing. Occasionally, when the esophagitis is healed,\n          one can see Barrett\u2019s esophagus. It is extremely uncommon to develop Barrett\u2019s esophagus and then develop esophageal\n          cancer.\n          <p></p>\n          There is a 0.5-1% that Barrett\u2019s will turn into cancer.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading39\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse39\" aria-expanded=\"false\" aria-controls=\"collapse39\">\n            <span class=\"increment_number\"></span> How do PPIs protect the stomach/esophagus lining from ulcers and inflammation?\n          </a>\n          <span class=\"opinion\">my opinion</span>\n          <span class=\"knowledge\">knowledge</span>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse39\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading39\">\n        <div>\n          <span class=\"\">URL</span>\n\n        </div>\n        <div class=\"card-block\">\n          They protect it by drastically reducing stomach acid and creating an environment with very little stomach acid means that\n          the stomach lining can heal over time because there isn\u2019t a corrosive substance which damages it anymore (stomach\n          acid).\n          <p></p>\n          The same goes for the esophagus lining. GERD may still be present but since the stomach acid has dropped in the stomach the\n          reflux becomes less corrosive. Therefore the esophagus heals over time.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading40\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse40\" aria-expanded=\"false\" aria-controls=\"collapse40\">\n            <span class=\"increment_number\"></span> How long does it take to heal an ulcer when you are using PPIs daily?\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse40\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading40\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"http://www.webmd.com/digestive-disorders/proton-pump-inhibitors-for-peptic-ulcer-disease\" class=\"url\" target=\"_blank\">#1</a>\n\n        </div>\n        <div class=\"card-block\">\n          Most ulcers heal within 4 weeks, although some people may need up to 4 more weeks of treatment to complete healing. In rare\n          cases, large ulcers need even longer treatment.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading41\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse41\" aria-expanded=\"false\" aria-controls=\"collapse41\">\n            <span class=\"increment_number\"></span> How long does it take to heal gastritis with PPIs?\n          </a>\n          <span class=\"opinion\">my opinion</span>\n        </h5>\n      </div>\n\n      <div id=\"collapse41\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading41\">\n        <div>\n          <span class=\"\">URL</span>\n\n        </div>\n        <div class=\"card-block\">\n          Gastritis means inflamed stomach lining. It usually occurs due to Helicobacter pylori or hypersecretion of gastic acid. It\n          usually takes 4 weeks to heal. It also depends of what type of Gastritis you have. Acute, chronic, atrophic.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_17\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_17\" aria-expanded=\"false\" aria-controls=\"collapse_17\">\n            <span class=\"increment_number\"></span> What is the difference between dysplasia, metaplasia and neoplasia?\n          </a>\n          <span class=\"opinion\">my opinion</span>\n          <span class=\"knowledge\">knowledge</span>\n        </h5>\n      </div>\n\n      <div id=\"collapse_17\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_17\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"http://library.med.utah.edu/WebPath/NEOHTML/NEOPL003.html\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n\n          Metaplasia, dysplasia and neoplasia all represent the transformation of the stomach/esophagus lining (cells) which are not\n          good. The normal stomach-esophagus lining is called the squamous epithelium.\n          <p></p>\n          <b>Metaplasia:</b> the exchange of normal epithelium (normal lining) for another type of epithelium. Metaplasia\n          is reversible when the condition which caused it is healed or stopped.\n          <p></p>\n          <b>Dysplasia:</b> a disordered growth and maturation of an epithelium, which is still reversible (harder reversible\n          than metaplasia) if the condition which caused it is healed or stopped.\n          <p></p>\n          <b>Neoplasia:</b> neoplasia of the stomach-esophagus lining means cancer and it is not reversible like metaplasia\n          and dysplasia are. It represents an abnormal growth of cells. It can be benign and malignant.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading42\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse42\" aria-expanded=\"false\" aria-controls=\"collapse42\">\n            <span class=\"increment_number\"></span> Which organs do PPIs pass by when dissolving?\n          </a>\n          <span class=\"knowledge\">knowledge</span>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse42\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading42\">\n        <div>\n          <span class=\"\">URL</span>\n          <a href=\"https://en.wikipedia.org/wiki/Omeprazole\" class=\"url\" target=\"_blank\">#1</a>\n\n        </div>\n        <div class=\"card-block\">\n          Omeprazole (PPI) is completely metabolized by the cytochrome P450 (protein) system, mainly in the liver. Identified metabolites\n          are the sulfone, the sulfide, and hydroxy-omeprazole, which exert no significant effect on acid secretion.\n          About 80% of an orally given dose is excreted as metabolites in the urine, and the remainder is found in the\n          feces, primarily originating from bile secretion\n        </div>\n      </div>\n    </div>\n    <h3 id=\"sides_heading\" style=\"color:#aa5d00;\">Side-effects</h3>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading43\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse43\" aria-expanded=\"false\" aria-controls=\"collapse43\">\n            <span class=\"increment_number\"></span> What are long-term side effects of PPIs?\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse43\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading43\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.medscape.com/viewarticle/804146_3\" class=\"url\" target=\"_blank\">#1</a>\n          <a href=\"http://www.medscape.com/viewarticle/859438\" class=\"url\" target=\"_blank\">#2</a>\n          <a href=\"http://www.webmd.com/heartburn-gerd/news/20150610/popular-heartburn-meds-linked-to-higher-risk-of-heart-attack#1\"\n            class=\"url\" target=\"_blank\">#3</a>\n          <a href=\"http://www.medscape.com/viewarticle/876199\" class=\"url\" target=\"_blank\">#4</a>\n        </div>\n        <div class=\"card-block\">\n          <ul>\n            <li>\n              <b>Iron</b> (absorption reduced)</li>\n            <li>\n              <b>Calcium</b> (There is no good evidence to establish that PPI use has a significant risk for bone density\n              loss or osteoporotic-related fractures)</li>\n            <li>\n              <b>Magnesium</b> (rare)</li>\n            <li>\n              <b>B12 deficiency</b> (no studies have provided a longitudinal evaluation)</li>\n            <li>\n              <b>Community acquired pneumonia</b> (small risk)</li>\n            <li>\n              <b>Clostridium Difficile infection</b> (insufficient evidence to conclude that there is a definitive relationship)</li>\n            <li>\n              <b>Small Intestinal Bacterial Overgrowth</b> (no clear supporting data at present to suggest a positive relationship)</li>\n            <li>\n              <b>Spontaneous Bacterial Peritonitis</b> (no definitive evidence for conclusion)</li>\n            <li>\n              <b>Interstitial Nephritis</b> (rare)</li>\n            <li>\n              <b>Dementia</b>\n            </li>\n            <li>\n              <b>Heart attack</b> (slightly elevated risk)</li>\n            <li>\n              <b>CKD</b> (increased risk for chronic renal damage)</li>\n          </ul>\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading44\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse44\" aria-expanded=\"false\" aria-controls=\"collapse44\">\n            <span class=\"increment_number\"></span> What if I have major side effect/s from a PPI, but need to stay on them?\n          </a>\n          <span class=\"opinion\">my opinion</span>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse44\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading44\">\n        <div>\n          <span class=\"\">URL</span>\n\n        </div>\n        <div class=\"card-block\">\n          In situations like this you should always talk to your specialist. Such questions are difficult to answer primarily because\n          of your safety. However, if you really need the PPI and cannot substitute it with a less potent drug then you\n          should stay on the lowest effective dose possible.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading45\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse45\" aria-expanded=\"false\" aria-controls=\"collapse45\">\n            <span class=\"increment_number\"></span> How to reduce PPIs possible future side effects?\n          </a>\n          <span class=\"opinion\">my opinion</span>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse45\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading45\">\n        <div>\n          <span class=\"\">URL</span>\n\n        </div>\n        <div class=\"card-block\">\n          There isn\u2019t a guide on what a patient should do in order to minimize the chances of getting a side effect from this drug.\n          However there are general known principles:\n          <ul>\n            <li>Work out </li>\n            <li>Eat healthy</li>\n            <li>Reduce your stress levels</li>\n            <li>If you have an anxiety disorder then try to minimize it. It can be achieved with certain therapies</li>\n            <li>Remove the trigger food from your diet</li>\n            <li>Treat your disease with medication appropriately</li>\n            <li>Don't use drugs on your own (OTC-over the counter) for more then 14 days</li>\n          </ul>\n\n        </div>\n      </div>\n    </div>\n\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading46\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse46\" aria-expanded=\"false\" aria-controls=\"collapse46\">\n            <span class=\"increment_number\"></span> What are the most common side effects from PPIs?\n          </a>\n          <span class=\"knowledge\">knowledge</span>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse46\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading46\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"https://en.wikipedia.org/wiki/Proton-pump_inhibitor\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          <ul>\n            <li>Common\n              <ul>\n                <li>\n                  <b>Headache</b>\n                </li>\n                <li>\n                  <b>Nausea</b>\n                </li>\n                <li>\n                  <b>Diarrhea</b>\n                </li>\n                <li>\n                  <b>Abdominal pain</b>\n                </li>\n                <li>\n                  <b>Fatigue</b>\n                </li>\n                <li>\n                  <b>Dizzines</b>\n                </li>\n              </ul>\n            </li>\n            <li>Infrequent\n              <ul>\n                <li>\n                  <b>Rash</b>\n                </li>\n                <li>\n                  <b>Itch</b>\n                </li>\n                <li>\n                  <b>Flatulence</b>\n                </li>\n                <li>\n                  <b>Constipation</b>\n                </li>\n                <li>\n                  <b>Anxiety</b>\n                </li>\n                <li>\n                  <b>Depression</b>\n                </li>\n              </ul>\n            </li>\n\n          </ul>\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading47\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse47\" aria-expanded=\"false\" aria-controls=\"collapse47\">\n            <span class=\"increment_number\"></span> Do PPIs cause acid rebound when stopped?\n          </a>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse47\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading47\">\n        <div>\n          <span class=\"\">URL</span>\n          <a class=\"url\" href=\"http://www.refluxmd.com/what-to-expect-if-you-reduce-ppi-use/\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          Based on studies, we can say that PPIs used long-term produce a change in the gastrin-parietal cell balance that results\n          in a temporary rebound over-secretion of acid when PPIs are withdrawn suddenly.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading48\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse48\" aria-expanded=\"false\" aria-controls=\"collapse48\">\n            <span class=\"increment_number\"></span> Why do some people on PPIs experience horrible side effects while other don\u2019t?\n          </a>\n          <span class=\"knowledge\">knowledge</span>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse48\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading48\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://health.stackexchange.com/questions/9956/why-some-people-have-no-side-effects-from-a-drug\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          Many factors can increase the likelihood of an adverse drug reaction. They include\n          <ul>\n            <li>Simultaneous use of several drugs</li>\n            <li>Very young or old age</li>\n            <li>Pregnancy</li>\n            <li>Breastfeeding</li>\n          </ul>\n          Hereditary factors make some people more susceptible to the toxic effects of certain drugs. Certain diseases can alter drug\n          absorption, metabolism, and elimination and the body's response to drugs, increasing the risk of adverse drug\n          reactions. How mind-body interactions, such as mental attitude, outlook, belief in self, and confidence in\n          health care practitioners, influence adverse drug reactions remains largely unexplored.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading49\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse49\" aria-expanded=\"false\" aria-controls=\"collapse49\">\n            <span class=\"increment_number\"></span> Are side effects common when taking PPIs?\n          </a>\n          <span class=\"opinion\"> my opinion</span>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse49\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading49\">\n        <div>\n          <span class=\"\">URL</span>\n\n        </div>\n        <div class=\"card-block\">\n          Every drug has a side effect. There are common and rare side effects with any pharmacy drug. The majority of patients on\n          PPIs react well on them and do not experience any severe side effects associated to the drug.\n\n        </div>\n      </div>\n    </div>\n    <h3 id=\"general_heading\" style=\"color:#aaa407;\">General</h3>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_20\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_20\" aria-expanded=\"false\" aria-controls=\"collapse_20\">\n            <span class=\"increment_number\"></span> What is the difference between heartburn, acid reflux and GERD?\n          </a>\n          <span class=\"opinion\">my opinion</span>\n          <span class=\"knowledge\">knowledge</span>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_20\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_20\">\n        <div>\n          <span class=\"url\">URL</span>\n        </div>\n        <div class=\"card-block\">\n          People often think that GERD = acid reflux = heartburn. In one way we can say that this is true. Heartburn is the key symptom\n          here. GERD and acid reflux are here because of heartburn happening.\n          <p></p>\n          Acid reflux can be described as \u201Coccasional heartburn\u201D. The main reason is overeating as well as bad diet and trigger foods,\n          lifestyle often can fix acid reflux.\n          <p></p>\n          GERD on the other hand is a chronic condition where acid gets into your esophagus more often. Several times a week or daily.\n          <p></p>\n          GERD often needs chronic drugs treatment. If not treated things can get worse and although rare, cancer of the esophagus\n          can form which such condition.\n          <p></p>\n          <b>Remember: GERD> acid reflux > heartburn</b>\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_21\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_21\" aria-expanded=\"false\" aria-controls=\"collapse_21\">\n            <span class=\"increment_number\"></span> When should I visit a doctor when having a stomach pain/discomfort?\n          </a>\n          <span class=\"opinion\">my opinion</span>\n          <span class=\"knowledge\">knowledge</span>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_21\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_21\">\n        <div>\n          <span class=\"url\">URL</span>\n\n        </div>\n        <div class=\"card-block\">\n          As with everything else, if you have occasional stomach pain (let\u2019s say once or twice month), if you get stomach pain from\n          overeating or binge drinking then you hardly need to visit your doctor. However if you have a persistent stomach\n          pain and other symptoms accompanying the pain for longer than 1 week or if this is repeating itself every month\n          or so, then you should definitely visit a doctor.\n          <p></p>\n          You can always try to manage your condition with diet or eliminating certain foods when having often stomach pain/discomfort.\n          If that doesn\u2019t help then you know that something else is going on which doesn\u2019t mean that it\u2019s something serious\n          but needs medical evaluation.\n          <p></p>\n          Of course, if you have unbearable stomach pain followed by other symptoms, then you should visit the emergency room.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading50\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse50\" aria-expanded=\"false\" aria-controls=\"collapse50\">\n            <span class=\"increment_number\"></span> How long do you have to be on PPIs in order to say that you are a long-term user?\n            <span class=\"knowledge\">knowledge</span>\n          </a>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse50\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading50\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.medscape.com/viewarticle/820136_2\" class=\"url\" target=\"_blank\t\">#1</a>\n          <a href=\"http://health.stackexchange.com/questions/5555/how-many-years-is-considered-long-term-drug-medications-usage\" class=\"url\"\n            target=\"_blank\">#2</a>\n        </div>\n        <div class=\"card-block\">\n          Definition in the literature for \"long-term\" is lacking; neither the AGA guidelines nor the ACG guidelines define what is\n          considered long-term. For the rest of this article, the authors use long-term to designate therapy greater\n          than 14 days. Basically, if you continue PPI therapy for longer than 14 days every year you can they say that\n          you've been longterm on them.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading51\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse51\" aria-expanded=\"false\" aria-controls=\"collapse51\">\n            <span class=\"increment_number\"></span> Are PPIs widely used?\n          </a>\n          <span class=\"opinion\">my opinion</span>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse51\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading51\">\n        <div>\n          <span class=\"url\">URL</span>\n\n        </div>\n        <div class=\"card-block\">\n          Yes PPIs are one of the most prescribed and bought over the counter drugs in the world. They are just behind pain, cholesterol\n          and blood pressure medication in terms of usage.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_25\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_25\" aria-expanded=\"false\" aria-controls=\"collapse_25\">\n            <span class=\"increment_number\"></span> How come the stomach acid doesn't burn the stomach with its acidity?\n          </a>\n          <span class=\"knowledge\">knowledge</span>\n        </h5>\n      </div>\n      <div id=\"collapse_25\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_51\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"https://biology.stackexchange.com/questions/6820/how-does-hcl-not-burn-our-stomach\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          Mucous-producing cells at the neck of the gastric pits create a layer of protective mucous covering the stomach lining. This\n          mucous layer includes bicarbonate ions which act as a chemical barrier against the protons in gastric juice.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_22\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_22\" aria-expanded=\"false\" aria-controls=\"collapse_22\">\n            <span class=\"increment_number\"></span> What is Gastrin and why do I hear about it often?\n            <span class=\"knowledge\">knowledge</span>\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_22\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_22\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.hormone.org/hormones-and-health/what-do-hormones-do/gastrin\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          Gastrin is a hormone the stomach produces which then stimulates the release of gastric acid when you eat. It breaks down\n          protein in the food and kills bacteria which is in the food. In this way the gut is being protected from infection.\n          <p></p>\n          High levels of gastrin cells and circulating gastrin hormone can also occur if the pH of the stomach is too high (the stomach\n          is low in acid).\n          <p></p>\n          Low gastrin levels are rare. When low levels do occur, the condition can increase the risk of infection in the digestive\n          system, and also limits the stomach's ability to absorb nutrients.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_23\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_23\" aria-expanded=\"false\" aria-controls=\"collapse_23\">\n            <span class=\"increment_number\"></span> What is peristalsis?\n          </a>\n        </h5>\n      </div>\n\n      <div id=\"collapse_23\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_23\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"https://medlineplus.gov/ency/anatomyvideos/000097.htm\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          Peristalsis is a series of wave-like muscle contractions that moves food to different processing stations in the digestive\n          tract. The process of peristalsis begins in the esophagus when a bolus of food is swallowed. The strong wave-like\n          motions of the smooth muscle in the esophagus carry the food to the stomach, where it is churned into a liquid\n          mixture called chyme.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_28\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_28\" aria-expanded=\"false\" aria-controls=\"collapse_28\">\n            <span class=\"increment_number\"></span> Is there a connection between sinuses and GERD?\n          </a>\n        </h5>\n      </div>\n\n      <div id=\"collapse_28\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_28\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.livestrong.com/article/529074-can-acid-reflux-cause-pain-in-the-sinuses/\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          GERD can affect the sinuses. This is a matter of increasing interest to researchers.A number of studies make a very plausible\n          connection between GERD and chronic sinusitis.\n          <p></p>\n          Although the connection between acid reflux and CRS (chronic rhino sinusitis) isn\u2019t well understood, there are several possible\n          reasons for the increased risk of CRS in acid reflux patients. One is that exposure to acid gastric fluids\n          could injure the lining of the nasal cavities, provoking a series of immune responses such as inflammation\n          and allowing infection. They could also irritate sympathetic nerves in the respiratory system, causing nasal\n          congestion, excessive nasal secretions and continuous post nasal drainage. LRS may also contribute to infection\n          of the upper airways by bacteria from the intestinal tract.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading52\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse52\" aria-expanded=\"false\" aria-controls=\"collapse52\">\n            <span class=\"increment_number\"></span> At which position are PPIs on the top ten drugs list consumed by people in the USA?\n          </a>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse52\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading52\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.medscape.com/viewarticle/849457\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          The proton pump inhibitor esomeprazole (Nexium, AstraZeneca), at $4.7 billion is the top 10 drugs sold in the US reaching\n          number 8 on the list.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_26\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_26\" aria-expanded=\"false\" aria-controls=\"collapse_26\">\n            <span class=\"increment_number\"></span> How many people in the world suffer from GERD?\n            <span class=\"knowledge\">knowledge</span>\n          </a>\n        </h5>\n      </div>\n\n      <div id=\"collapse_26\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_26\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"https://en.wikipedia.org/wiki/Proton-pump_inhibitor\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          GERD affects between 18% and 28% of the adult U.S. population (children, teenagers not included). That means between 42 million\n          and 64 million adults in the U.S. suffer from GERD.\n          <p></p>\n          Europeans, Middle Easterners and South Americans also have high rates: in Europe, between 9% and 26% of the adult population\n          meets the criteria to be diagnosed with GERD, as do up to 33% of adults in the Middle East and 23% of adults\n          living in South America. Meanwhile, the rate of GERD in East Asian adults is only around 2% to 8%, and in Australian\n          adults it's 12%.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_004\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_004\" aria-expanded=\"false\" aria-controls=\"collapse_004\">\n            <span class=\"increment_number\"></span> Why don't people with LPR have heartburn?\n            <span class=\"knowledge\">knowledge</span>\n          </a>\n        </h5>\n      </div>\n\n      <div id=\"collapse_004\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_004\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.mwent.com/patient-services/silent-reflux-treatment\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          Some people with LPR do have heartburn. Some people with LPR don't have heartburn very often, but actually about half the\n          people who have LPR never have any heartburn at all. This is because the material that refluxes does not stay\n          in the esophagus for very long. In other words, the acid does not have enough time to irritate the esophagus\n          and cause heartburn.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading53\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse53\" aria-expanded=\"false\" aria-controls=\"collapse53\">\n            <span class=\"increment_number\"></span> How long have PPIs been on the market?\n          </a>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse53\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading53\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"https://en.wikipedia.org/wiki/Discovery_and_development_of_proton_pump_inhibitors\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          PPIs were developed in the late 80\u2019s. With omeprazole being the first PPI to be launched on the market in 1988. After that\n          came Lansoprazole being launched in Europe in 1991 and the US in 1995. Pantoprazole was the third PPI and was\n          introduced to the German market in 1994 after 7 years of clinical trials. Then came Rabeprazole which is a\n          novel benzimidazole compound on market, since 1999 in USA. It is similar to lansoprazole. After that came esomeprazole\n          in 2001 which was launched in USA. Dexlansoprazole was launched as a follow up of lansoprazole in 2009. with\n          its popular dual release technology.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading54\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse54\" aria-expanded=\"false\" aria-controls=\"collapse54\">\n            <span class=\"increment_number\"></span> Approximately how many people in the world are using PPIs to treat their condition?\n          </a>\n          <span class=\"noanswer\">noanswer</span>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse54\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading54\">\n        <div>\n          <span class=\"url\">URL</span>\n\n        </div>\n        <div class=\"card-block\">\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading55\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse55\" aria-expanded=\"false\" aria-controls=\"collapse55\">\n            <span class=\"increment_number\"></span> How often should I go for a blood test when taking PPIs long-term?\n          </a>\n          <span class=\"opinion\">my opinion</span>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse55\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading55\">\n        <div>\n          <span class=\"url\">URL</span>\n\n        </div>\n        <div class=\"card-block\">\n          Doctors still do not recommend taking blood test to check for some mineral, vitamin deficiencies if you are on a long-term\n          drug therapy. However if you do get side effects or are on a continuous PPI therapy for years, it would be\n          wise to check your blood for any mineral, vitamin deficiencies as well as your overall blood picture. Remember\n          to discuss your actions with your doctor.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_002\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_002\" aria-expanded=\"false\" aria-controls=\"collapse_002\">\n            <span class=\"increment_number\"></span> Why is upper GI bleeding manifested in black stool, what causes the stool to go black?\n            <!-- <span class=\"opinion\">my opinion </span> -->\n          </a>\n        </h5>\n      </div>\n\n      <div id=\"collapse_002\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_002\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"https://www.livestrong.com/article/104522-causes-black-stool-color/\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n            Bleeding in the upper digestive tract including the esophagus, stomach and upper portion of the small intestine\n            is the most worrisome cause of black stools. The blood causes the stool to turn black as it works its way\n            from the upper to the lower intestine before being passed during a bowel movement. Bleeding in the lower\n            digestive track usually causes red or maroon stools, or bloody streaks or clots in the fecal matter rather\n            than black stool. It takes a significant amount of bleeding -- usually at least 100 milliliters or 0.4 cups\n            -- from the upper digestive tract to cause black stools. Some of the possible causes of this type of upper\n            digestive tract bleeding include:\n            <p></p>\n          So, black stools could indicate upper GI bleeding, whereas bright red stool indicates lower GI bleeding.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_27\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_27\" aria-expanded=\"false\" aria-controls=\"collapse_27\">\n            <span class=\"increment_number\"></span> Does stress really cause ulcers?\n          </a>\n          <span class=\"opinion\">my opinion</span>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_27\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_27\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.news-medical.net/news/2004/08/27/4372.aspx\" class=\"url\" target=\"_blank\">#1</a>\n          <a href=\"https://www.zocdoc.com/answers/4894/can-stress-cause-ulcers\" class=\"url\" target=\"_blank\">#2</a>\n\n        </div>\n        <div class=\"card-block\">\n          Before the discovery of H. Pylori. Doctors thought that stress was the cause of ulcers. After the discovery of the bacteria,\n          things have changed. The today thought is that stress can only make ulcers worse but does not cause them.\n          <p></p>\n          \u201EStress, especially prolonged stress, can have an effect on stomach acid production. While this alone can cause ulcers in\n          some cases, most of the time the bacterial infection or use of anti-inflammatory drugs in the stomach is required.\n          \u201C\n          <p></p>\n          \u201CStress won't cause stomach ulcers, but it can make them worse,\u201D says Dr. David Graham, professor of medicine and molecular\n          virology and microbiology at Baylor College of Medicine. \u201CStress causes the body to produce higher amounts\n          of acid, which can irritate preexisting ulcers.\u201D\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading56\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse56\" aria-expanded=\"false\" aria-controls=\"collapse56\">\n            <span class=\"increment_number\"></span> What is the cheapest PPI on the market?\n          </a>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse56\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading56\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"https://www.goodrx.com/proton-pump-inhibitors\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          Prilosec (generic-omeprazole) and Protonix (generic-pantoprazole) are the least expensive PPIs.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading57\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse57\" aria-expanded=\"false\" aria-controls=\"collapse57\">\n            <span class=\"increment_number\"></span> What is the most expensive PPI on the market?\n          </a>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse57\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading57\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"https://www.goodrx.com/proton-pump-inhibitors\" class=\"url\" target=\"_blank\">#1</a>\n\n        </div>\n        <div class=\"card-block\">\n          Dexlansoprazole (Dexilant) and Omeprazole/sodium bicarbonate (Zegerid) are the most expensive PPI drugs on the market.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_30\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_30\" aria-expanded=\"false\" aria-controls=\"collapse_30\">\n            <span class=\"increment_number\"></span> What is basal acid output (can you measure secretion of HCL)?\n          </a>\n        </h5>\n      </div>\n\n      <div id=\"collapse_30\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_30\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://medical-dictionary.thefreedictionary.com/basal+acid+output\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          the minimum amount of gastric acid produced by an individual in a given time period. Normal adult volume is 2 to 5 mEq/hr.\n          It is used infrequently in the diagnosis of various diseases of the stomach and intestines, such as gastric\n          ulcers and Zollinger-Ellison syndrome.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_31\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_31\" aria-expanded=\"false\" aria-controls=\"collapse_31\">\n            <span class=\"increment_number\"></span> What does the pH of the stomach have to be in order to heal itself from gastritis?\n            <span class=\"noanswer\">noanswer</span>\n          </a>\n        </h5>\n      </div>\n\n      <div id=\"collapse_31\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_31\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"https://en.wikipedia.org/wiki/Proton-pump_inhibitor\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_013\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_013\" aria-expanded=\"false\" aria-controls=\"collapse_013\">\n            <span class=\"increment_number\"></span> Why doesn't the stomach acid erode the intestine lining when it goes down the stomach?\n            <!-- <span class=\"noanswer\">noanswer</span> -->\n          </a>\n        </h5>\n      </div>\n\n      <div id=\"collapse_013\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_013\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"https://en.wikipedia.org/wiki/Gastric_acid\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          The pancreas (organ) produces large amounts of bicarbonate and secretes bicarbonate through the pancreatic\n            duct to the duodenum to completely neutralize any gastric acid that passes further down into the digestive\n            tract. Thereby, you don't have stomach acid which could harm your small intestine<\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_32\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_32\" aria-expanded=\"false\" aria-controls=\"collapse_32\">\n            <span class=\"increment_number\"></span> Do genetics play an important role in getting esophagus-stomach-duodenum problems?\n          </a>\n        </h5>\n      </div>\n\n      <div id=\"collapse_32\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_32\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.upi.com/Archives/1984/11/12/Stress-does-not-cause-ulcers-your-parents-give-them/6031469083600/\" class=\"url\"\n            target=\"_blank\">#1</a>\n          <a href=\"https://www.youtube.com/watch?v=Q2fyzcjcGPo&feature=youtu.be&t=2m23s\" class=\"url\" target=\"_blank\">#2</a>\n        </div>\n        <div class=\"card-block\">\n          'It's true that a body under stress may produce acid, but not enough to create or aggravate an ulcer,' said Dr. Seymour Sabesin.\n          Dr. Jerome Rotter, of the UCLA Medical Center, said heredity, not stress, is the likely cause of 80 percent\n          of the duodenal ulcers that afflict 500,000 Americans. The genes your parents pass down to you will most likely\n          determine your susceptibility, he said.\n          <p></p>\n          The article also said ulcer sufferers may not have to follow a bland diet.\n          <p></p>\n          Sufferers 'should avoid any food that causes irritation and should use alcohol and caffeine in moderation,' the article said.\n          'But a bland diet just doesn't make a difference.'\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_some1\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_some1\" aria-expanded=\"false\"\n            aria-controls=\"collapse_some1\">\n            <span class=\"increment_number\"></span> What is a drug interaction?\n            <span class=\"knowledge\">knowledge</span>\n          </a>\n        </h5>\n      </div>\n\n      <div id=\"collapse_some1\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_some1\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"https://aidsinfo.nih.gov/understanding-hiv-aids/fact-sheets/21/95/what-is-a-drug-interaction-\" class=\"url\" target=\"_blank\">#1</a>\n          <a href=\"https://www.britannica.com/technology/pharmaceutical-industry/Obstacles-in-drug-development#ref925421\" class=\"url\"\n            target=\"_blank\">#2</a>\n        </div>\n        <div class=\"card-block\">\n          A drug interaction is a reaction between two (or more) drugs or between a drug and a food or beverage. Taking\n            a drug while having certain medical conditions can also cause a drug interaction. For example, taking a nasal\n            decongestant if you have high blood pressure may cause an unwanted reaction. A drug interaction can decrease\n            or increase the action of a drug or cause unwanted side effects.<p></p>\n\n            Drug interactions occur when one drug alters the pharmacological effect of another drug. The pharmacological\n            effect of one or both drugs may be increased or decreased, or a new and unanticipated adverse effect may\n            be produced. Drug interactions may result from pharmacokinetic interactions (absorption, distribution, metabolism,\n            and excretion) or from interactions at drug receptors.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_33\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_33\" aria-expanded=\"false\" aria-controls=\"collapse_33\">\n            <span class=\"increment_number\"></span> What are the survival rates of esophagus cancer and how many people get it?\n            <span class=\"knowledge\">knowledge</span>\n          </a>\n        </h5>\n      </div>\n\n      <div id=\"collapse_33\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_33\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.cancer.net/cancer-types/esophageal-cancer/statistics\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          The 5-year survival rate for people with esophageal cancer is 18%.\n          <p></p>\n          However, survival rates depend on several factors, including the stage of the cancer when it is first diagnosed.\n          <ul>\n            <li>The 5-year survival rate of people with cancer located only in the esophagus is 41% </li>\n            <li> The 5-year survival rate for those with disease that has spread to surrounding tissues or organs and/or the\n              regional lymph nodes is 23%</li>\n            <li>\n              If esophagus cancer has spread to distant parts of the body, the survival rate is 5%.\n            </li>\n          </ul>\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_009\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_009\" aria-expanded=\"false\" aria-controls=\"collapse_009\">\n            <span class=\"increment_number\"></span> How to prevent stomach cancer?\n            <span class=\"knowledge\">knowledge</span>\n          </a>\n        </h5>\n      </div>\n\n      <div id=\"collapse_009\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_009\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"https://www.nostomachforcancer.org/about/risk-prevention\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          <ul>\n            <li>Early detection is the key to surviving stomach cancer.</li>\n            <li>Lifestyle changes, such as smoking cessation and eating a diet rich in fruits and vegetables, can potentially\n              reduce the risk of stomach cancer.</li>\n            <li>Treatment of\n              <a href=\"http://www.gastroendonews.com/Retroflexions/Article/05-17/How-did-I-get-a-Helicobacter-pylori-infection-Is-H-pylori-contagious-/41501\"\n                target=\"_blank\" rel=\"noopener noreferrer\">H. pylori infection</a> (a common bacterial infection of the stomach) can decrease the risk of stomach\n              cancer development.</li>\n            <li>Knowing your family history and discussing it with your healthcare provider can help determine if you are\n              at risk for inherited cancer syndromes.</li>\n          </ul>\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_34\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_34\" aria-expanded=\"false\" aria-controls=\"collapse_34\">\n            <span class=\"increment_number\"></span> What are the survival rates of stomach cancer and how many people get it?\n          </a>\n        </h5>\n      </div>\n\n      <div id=\"collapse_34\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_34\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"https://www.urmc.rochester.edu/encyclopedia/content.aspx?contenttypeid=34&contentid=BStoD7\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          <ul>\n            <li>\n            If healthcare providers find the stomach cancer in early stages when the cancer is still only in the stomach,\n                the 5 year survival rate is about 65%.\n\n            </li>\n            <li>\n            If they find the stomach cancer when it has spread to areas near your stomach , the 5 year survival rate\n                is about 30%.\n\n            </li>\n            <li>\n              If they find the stomach cancer when it has spread far away from your stomach, the 5 year survival rate\n                is about 5%.\n\n            </li>\n            <li>\n            For all stages of stomach cancer combined, the five-year survival rate is about 29%.\n\n            </li>\n          </ul>\n        </div>\n      </div>\n    </div>\n    <h3 id=\"lifestyle_heading\" style=\"color:#3736ac;\">Lifestyle</h3>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading58\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse58\" aria-expanded=\"false\" aria-controls=\"collapse58\">\n            <span class=\"increment_number\"></span> Can I drink alcohol when using PPIs?\n          </a>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse58\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading58\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.livestrong.com/article/553816-can-you-take-lansoprazole-and-drink-alcohol/\" class=\"url\" target=\"_blank\">#1</a>\n\n        </div>\n        <div class=\"card-block\">\n          Alcohol can irritate the lining of the stomach and cause excess production of acid. This may lead to ulcers and gastritis,\n          and it can also aggravate GERD. In addition, alcohol can cause clumping of red blood cells, which may clog\n          blood vessels, leading to bleeding, hemorrhaging and possibly to death.\n          <p></p>\n          Although drinking alcohol is not contraindicated when using lansoprazole (PPI), caution is advised. Side effects from taking\n          lansoprazole include drowsiness and dizziness, which may be aggravated by NSAIDs. These medications may cause\n          stomach ulcers and bleeding, which might be exacerbated by the consumption of alcohol. Certain medical conditions\n          may be made worse if you drink alcohol while taking lansoprazole. If you have an alcohol problem, are suffering\n          from dehydration, or have low blood sodium levels, your doctor may advise you to avoid drinking alcohol while\n          taking this medication.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading59\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse59\" aria-expanded=\"false\" aria-controls=\"collapse59\">\n            <span class=\"increment_number\"></span> Is it OK to smoke while using PPIs?\n          </a>\n          <span class=\"opinion\">my opinion</span>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse59\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading59\">\n        <div>\n          <span class=\"url\">URL</span>\n\n        </div>\n        <div class=\"card-block\">\n          If you are taking a PPI then you should definitely find a way how to reduce your smoking passion. Smoking not only increases\n          stomach acid but also relaxes the valve (sphincter) because of the nicotine substance which closes after the\n          food enters your stomach and therefore prevents reflux. The opening/closing sphincter is actually the main\n          culprit for GERD. If it is really hard for you to stop smoking then at least stop smoking during the ongoing\n          PPI therapy usually 4-8 weeks. Smoking will definitely extend the healing of your stomach/esophagus lining.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading60\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse60\" aria-expanded=\"false\" aria-controls=\"collapse60\">\n            <span class=\"increment_number\"></span> How should I eat while on PPIs?\n          </a>\n          <span class=\"knowledge\">knowledge</span>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse60\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading60\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.prilosecotc.com/en-us/tips-faq/heartburn-diet-tips\" class=\"url\" target=\"_blank\">#1</a>\n\n        </div>\n        <div class=\"card-block\">\n          <p>Heartburn foods to avoid:</p>\n          <ul>\n            <li>Foods that are fried, saut&eacute;ed, or prepared in butter or oil</li>\n            <li>High-fat side dishes such as onion rings or French fries</li>\n            <li>High-fat sauces, gravies, and salad dressings</li>\n            <li>Tomato-based foods and juices</li>\n            <li>Caffeinated beverages such as cola and iced tea</li>\n            <li>Citrus drinks such as lemonade or orange juice</li>\n            <li>Alcoholic beverages</li>\n            <li>Chocolate</li>\n            <li>After-dinner mints (peppermint can exacerbate heartburn)</li>\n          </ul>\n          <p>Heartburn foods to look for:</p>\n          <ul>\n            <li>White meat, which is lower in fat than dark meat</li>\n            <li>Leaner cuts of red meat</li>\n            <li>Smaller portion sizes</li>\n            <li>White wine instead of red</li>\n            <li>Lighter desserts, such as angel food cake</li>\n          </ul>\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_35\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_35\" aria-expanded=\"false\" aria-controls=\"collapse_35\">\n            <span class=\"increment_number\"></span> Will eliminating carbs help my acid reflux?\n          </a>\n\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_35\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_35\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"https://www.dietdoctor.com/low-carb-can-cure-reflux-disease\" target=\"_blank\">#1</a>\n          <a href=\"http://www.livestrong.com/article/496757-does-a-carb-free-diet-help-with-acid-reflux/\" class=\"url\" target=\"_blank\">#2</a>\n        </div>\n        <div class=\"card-block\">\n          A study tested a LCHF (low carbs high fiber) diet on a few people with this problem, and they got significantly better. Even\n          the pH in their esophagus improved.\n          <p></p>\n          Another slightly larger, study has tested this idea again. Not only does it find that carbohydrates, sugar and the glycemic\n          load of the diet was associated with reflux disease. They also test what happens when the participants goes\n          on a lower carb diet. The result indicates that all women in the study were able to get off their reflux (GERD)\n          medications.\n          <p></p>\n          The results from researchers at the University of North Carolina, Chapel Hill, published in the August 2006 issue of \"Digestive\n          Diseases and Sciences,\" which showed that a carb-restricted diet helped reduce the amount of time acid was\n          present in the esophagus of the participants in addition to improving most of the pain and other symptoms related\n          to their acid reflux. The diet used in this study was not completely carb-free because it included 20 grams\n          of carbs from nonstarchy vegetables daily, but eliminated grains, starchy vegetables, fruits and sugar.\n          <p></p>\n          The exact mechanism for the effectiveness of low-carb or carb-free diets in the management of acid reflux has yet to be determined.\n          if you are overweight or obese, a low-carb diet can help you lose weight, which can reduce the pressure on\n          your stomach and prevent acid reflux from occurring. However, the positive results found in the UNC study with\n          a very low-carb diet appeared within less than a week, indicates that a carbohydrate-restricted diet may alleviate\n          acid reflux in more than one way.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_36\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_36\" aria-expanded=\"false\" aria-controls=\"collapse_36\">\n            <span class=\"increment_number\"></span> Will eliminating gluten help my acid reflux\n          </a>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_36\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_36\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.everydayhealth.com/gerd/gerd-gluten-free-diet.aspx\" class=\"url\" target=\"_blank\">#1</a>\n\n        </div>\n        <div class=\"card-block\">\n          An article published in September 2011 issue of Diseases of Esophagus noted how a number of published studies have shown\n          that gluten-free diet can efficiently control esophageal symptoms and help prevent recurrence. In one study\n          from 2009, Italian researchers found that gluten-intolerant people on a gluten-free diet responded more favorably\n          to GERD treatment with medication. They also found that fewer gluten-free dieters experienced a recurrence\n          of their GERD symptoms, compared with the control group. The researchers concluded that a gluten-free diet\n          could help reduce GERD symptoms and prevent damaging acid reflux in those with celiac disease.\n          <p></p>\n          Most experts don\u2019t believe that gluten intolerance leads to GERD, or has any connection to GERD. \"Eliminating gluten for\n          reflux doesn't make sense because there's no association for reflux,\" says Michael Vaezi, MD, PhD, clinical\n          director of the division of gastroenterology and hepatology and director of the Center for Esophageal Motility\n          Disorders at Vanderbilt University in Nashville, Tenn.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_37\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_37\" aria-expanded=\"false\" aria-controls=\"collapse_37\">\n            <span class=\"increment_number\"></span> Will eliminating lactose help my acid reflux?\n          </a>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_37\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_37\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.healthline.com/health/gerd/dairy-and-acid-reflux\" class=\"url\" target=\"_blank\">#1</a>\n\n        </div>\n        <div class=\"card-block\">\n          A study published in Gut and Liver assessed the relationship between cow\u2019s milk and acid reflux. When exposed to milk, 72\n          of out the 81 participants had digestive problems such as acid reflux.\n          <p></p>\n          These participants were then given medication called omeprazole to reduce stomach acid. Even with the medication, 27 of these\n          participants still experienced symptoms.\n          <p></p>\n          Researchers then eliminated dairy from their diets. The result? The researchers concluded that milk allergy GERD are linked.\n          All participants showed significant improvement in their symptoms after eliminating milk from their diets.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading61\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse61\" aria-expanded=\"false\" aria-controls=\"collapse61\">\n            <span class=\"increment_number\"></span> What are the most recommended alternatives for PPIs (natural supplements)?\n          </a>\n          <span class=\"opinion\">my opinion</span>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse61\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading61\">\n        <div>\n          <span class=\"url\">URL</span>\n        </div>\n        <div class=\"card-block\">\n          Probiotics, apple cide vinegar, dgl liquorice, chamomile tea, slippery elm, digestive enzymes, aloe vera, cabbage juice,\n          persimmon tea, papaya\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading62\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse62\" aria-expanded=\"false\" aria-controls=\"collapse62\">\n            <span class=\"increment_number\"></span> Should I still seek for an alternative even though I\u2019m told to be on PPIs for life?\n          </a>\n          <span class=\"opinion\">my opinion</span>\n\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse62\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading62\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.prilosecotc.com/en-us/tips-faq/heartburn-diet-tips\" class=\"url\" target=\"_blank\">#1</a>\n\n        </div>\n        <div class=\"card-block\">\n          Of course you should. If you have such a condition where you have been told to stay on PPIs for life no matter what your\n          specialist says try to dig for a solution which could at least reduce your drug dosage. Today with the help\n          of the Internet everyone can \u201Cengineer\u201D their life\u2019s better than ever before. If you decide to go off that\n          medication keep in mind that you should get off the medication slowly (not overnight).\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading63\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse63\" aria-expanded=\"false\" aria-controls=\"collapse63\">\n            <span class=\"increment_number\"></span> Can a diet without PPIs help heal my condition (ulcers, gastritis, GERD)?\n          </a>\n          <span class=\"opinion\">my opinion</span>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse63\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading63\">\n        <div>\n          <span class=\"url\">URL</span>\n\n\n        </div>\n        <div class=\"card-block\">\n          For most patients PPIs will help heal their condition no matter what. If you smoke, drink, eat unhealthy PPIs will\n          improve your condition despite your bad habits. The problem is that once your tapper off the medication, there\n          is a big chance that your condition will return. The best thing to do is to go on a diet to get the maximum\n          effective and rapid healing process. The key is to find the trigger foods. You will find these by eating and\n          seeing what food, drink doesn\u2019t go well on your stomach, oesophagus. If you have a chronic condition it would\n          be wise to stay on a lifetime diet, avoiding smoking and heavy alcohol use. This doesn\u2019t mean that you can\u2018t\n          eat unhealthy food once in a while. It means that you should be aware of you chronic condition and treat it\n          with caution.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading012\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse012\" aria-expanded=\"false\" aria-controls=\"collapse012\">\n            <span class=\"increment_number\"></span> Can you do weight lifting with a hiatal hernia?\n          </a>\n          <!-- <span class=\"opinion\">my opinion</span> -->\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse012\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading012\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"https://www.livestrong.com/article/348997-weight-lifting-hiatal-hernia/\" class=\"url\" target=\"_blank\">#1</a>\n          <p></p>\n\n\n\n        </div>\n        <div class=\"card-block\">\n        You may lift weights and not realize you have a hiatal hernia if you don't develop the main symptom of acid\n          reflux. Upon discovery of a hernia, your doctor may restrict your weightlifting activities if he thinks the\n          sport is interfering with your health. Because excess pressure in the abdominal region can cause a hernia\n          to worsen, you may need to work with lighter weights, or switch to hand weights until you've had your hernia\n          repaired.\n        </div>\n      </div>\n    </div>\n    <h3 id=\"other_heading\" style=\"color:#00950b;\">Other</h3>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading64\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse64\" aria-expanded=\"false\" aria-controls=\"collapse64\">\n            <span class=\"increment_number\"></span> Is there a story on the NET of someone who took PPIs 30+ years?\n          </a>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse64\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading64\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.gerdhelp.com/blog/cindy-30-years-on-ppis-for-reflux-says-bone-scan-was-her-wakeup-call/\" class=\"url\"\n            target=\"_blank\">#1</a>\n\n        </div>\n        <div class=\"card-block\">\n\n          There are quite a few persons who have been on PPIs for 25+ years (stories are on the Internet, forum posts). You can find\n          these forum posts on my web page, click here. In the link above you can find Cindy story who was on PPIs for\n          almost 30 years.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading65\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse65\" aria-expanded=\"false\" aria-controls=\"collapse65\">\n            <span class=\"increment_number\"></span> What are the alternatives to PPIs (similar pharmacy drugs)?\n          </a>\n          <span class=\"knowledge\">knowledge</span>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse65\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading65\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"https://sites.google.com/site/barrettswessex/treatment/drugs\" class=\"url\" target=\"_blank\">#1</a>\n\n        </div>\n        <div class=\"card-block\">\n          <u>Antacids</u>\n          <p></p>\n          They work immediately on excess acid. They do not prevent excess acid occurring. These are drugs that neutralise the acid.\n          Most commonly they are made of chalk, calcium carbonate. Examples are Tums or Rennie.\n          <p></p>\n          <u>Alignates</u>\n          <p></p>\n          Gaviscon is the brand name of the white milky liquid that floats on the stomach contents as oil floats on water to reduce\n          the possibility of reflux whilst also providing a temporary protective film to the lower oesophagus and neutralising\n          the acid with an antacid component. (Some generic versions are now available.)\n          <p></p>\n          <u>H2 blockers</u>\n          <p></p>\n          Histamine H2 Receptor Antagonists work to block the (histamine H2) signals that tell the stomach to produce acid. (N.B. This\n          is not the same as an antihistamine which blocks histamine H1). The most common is Ranitidine, brand name Zantac\n          but others are available as shown below. These work proactively to reduce the amount of acid rather than being\n          an instant antacid. Often prescribed to be taken in the evening to reduce nighttime reflux of acid.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading66\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse66\" aria-expanded=\"false\" aria-controls=\"collapse66\">\n            <span class=\"increment_number\"></span> Why are PPIs under constant bombardment from the media recently?\n          </a>\n          <span class=\"opinion\">my opinion</span>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse66\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading66\">\n        <div>\n          <span class=\"url\">URL</span>\n\n\n        </div>\n        <div class=\"card-block\">\n          A lot of data has been collected from patients in the hospital who are on PPIs. PPIs have been associated with disease such\n          as: ckd, nephritis, osteoporosis, certain infections, dementia, heart problems etc. Up to this date no study\n          can confirm if PPIs really causes any of the condition above but correlation has proven positive. Remember\n          correlation does not equal causation.\n          <p></p>\n          In the last 2 years a lot has been written about PPIs and their negative impact on kidneys. Every once in a while a new study\n          comes which heavily correlates PPIs with nephritis and CKD at the end. No one knows for certain what could\n          be the mechanism of PPIs which would cause an impact on kidneys or whether PPIs really do some damage on them.\n          <p></p>\n          Nevertheless, PPIs are one of the drugs which are being heavily discussed in the media because of 2 things. They are used\n          by millions throughout the globe and there is a negative trend in terms of developing GERD\n          and stomach problems which shows that there will be more and more people who will develop gastroesophageal\n          diseases in the upcoming future not to mention that the media anxiously waits for \u201Cbad news\u201D to write sensation\n          articles.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading67\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse67\" aria-expanded=\"false\" aria-controls=\"collapse67\">\n            <span class=\"increment_number\"></span> Has anyone died from taking PPIs?\n          </a>\n          <span class=\"noanswer\">noanswer</span>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse67\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading67\">\n        <div>\n          <span class=\"url\">URL</span>\n\n        </div>\n        <div class=\"card-block\">\n          This question is too serious and very complicated to be given an answer from myself.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading68\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse68\" aria-expanded=\"false\" aria-controls=\"collapse68\">\n            <span class=\"increment_number\"></span> Does low acid due to PPIs compromise the immunity system?\n          </a>\n          <span class=\"opinion\">my opinion</span>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse68\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading68\">\n        <div>\n          <span class=\"url\">URL</span>\n\n\n        </div>\n        <div class=\"card-block\">\n          PPIs do not directly affect the immune system but by decreasing the stomach acid you might become vulnerable to certain bacteria\u2019s\n          which the immune system has to eliminate then. You can think of the stomach acid as the first line of defence\n          against bacteria\u2019s. Our stomach acid is so powerful that it destroys the bacteria which enters your digestive\n          system. Lack of stomach acid allows the bacteria to move further and then the immune system has to get rid\n          of it. This is why doctors say to remain on the lowest effective dose.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading69\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse69\" aria-expanded=\"false\" aria-controls=\"collapse69\">\n            <span class=\"increment_number\"></span> Why does the drug instruction paper say not to use PPIs for more than 14 days?\n          </a>\n          <span class=\"opinion\">my opinion</span>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse69\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading69\">\n        <div>\n          <span class=\"url\">URL</span>\n\n        </div>\n        <div class=\"card-block\">\n          Patients often get scared about this, especially when they have been on this drug for years. The reason why this is written\n          is because you should talk to your doctor after you are using the drug more than 14 days and review your condition\n          with him. OTC drugs should not be taken longterm, they are here to give you temporary relief. If the problems\n          is still present after 14 days then visit your doctor.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading011\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse011\" aria-expanded=\"false\" aria-controls=\"collapse011\">\n            <span class=\"increment_number\"></span> What does it mean when the drug is FDA approved? What testing does a drug have to undergo until it\n            becomes FDA approved?\n          </a>\n        </h5>\n      </div>\n\n      <div id=\"collapse011\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading011\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"https://www.fda.gov/ForPatients/Approvals/Drugs/ucm405622.htm\" class=\"url\" target=\"_blank\">#1</a>\n\n        </div>\n        <div class=\"card-block\">\n          The answer is quite extensive so please click on the link above\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading70\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse70\" aria-expanded=\"false\" aria-controls=\"collapse70\">\n            <span class=\"increment_number\"></span> Is it true that people in the third world (Africa) have less acid reflux than in developed countries?\n          </a>\n        </h5>\n      </div>\n\n      <div id=\"collapse70\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading70\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://drjohnday.com/5-reasons-to-get-off-acid-reducing-meds/\" class=\"url\" target=\"_blank\">#1</a>\n\n        </div>\n        <div class=\"card-block\">\n          Historically, heart burn symptoms were rarely seen in the developing world. For example, in a review of 36 published studies,\n          the risk of having acid reflux symptoms in China was less than 5% in any given week. The risk of acid reflux\n          is also extremely low in Africa.\n          <p></p>\n          The fact that acid reflux is rarely seen in the developing world is reason for hope. It suggests that there is something\n          about the American lifestyle which contributes to this condition. Based on these studies, if we can change\n          our lifestyles then most people can avoid acid reflux.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading006\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse006\" aria-expanded=\"false\" aria-controls=\"collapse006\">\n            <span class=\"increment_number\"></span> Is anxiety related gastritis my fault?\n\n          </a>\n        </h5>\n      </div>\n\n      <div id=\"collapse006\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading006\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"https://www.healthyplace.com/blogs/anxiety-schmanxiety/2014/07/your-anxiety-is-not-your-fault\" class=\"url\" target=\"_blank\">#1</a>\n\n        </div>\n        <div class=\"card-block\">\n           Anxiety is not your fault.\n           <p></p>\n          Psychological research is beginning to understand what causes anxiety (if we understand the cause, we can treat\n            anxiety by getting to the root of the problem) however, thus far researchers haven\u2019t been able to definitively\n            pinpoint exact causes. That said, we do know some things:\n            <p></p>\n\n          <ol>\n            <li>\n              Genetic Disposition for Anxiety</li>\n            <li>Someone\u2019s environment stress level, lifestyle, etc. can contribute to anxiety.</li>\n            <li>Neurology, things happening in\n              the brain, play a role.</li>\n            <li>Learned behaviors can make someone anxious (For example, if a parent responds to the world in an anxious\n              fashion, a child can learn anxious patterns. This does not mean, though, that parents cause anxiety in\n              their kids. Modeling a behavior might be a contributing factor in anxiety\u2019s development, but it\u2019s not a\n              single-handed cause.)</li>\n            <li>Psychological factors can increase anxiety, particularly unhealthy thought patterns\n            </li>\n          </ol>\n           <p></p>\n          Anxiety and stress are not the same. Anxiety is much more than stress. Even if you experience stress on a daily\n            basis (we all do today) this doesn't mean you are suffering from anxiety.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_newa\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_newa\" aria-expanded=\"false\"\n            aria-controls=\"collapse_newa\">\n            <span class=\"increment_number\"></span> Where does H. Pylori come from?\n          </a>\n        </h5>\n      </div>\n\n      <div id=\"collapse_newa\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_newa\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"https://medlineplus.gov/helicobacterpyloriinfections.html\" class=\"url\" target=\"_blank\">#1</a>\n          <a href=\"https://health.stackexchange.com/questions/5496/can-helicobacter-pylori-be-transmitted-through-saliva\" class=\"url\"\n            target=\"_blank\">#2</a>\n        </div>\n        <div class=\"card-block\">\n          Helicobacter pylori (H. pylori) is a type of bacteria which causes infection in the stomach. It is found in about 2/3 of\n          the world's population. It may be spread by unclean food and water, but researchers aren't sure.\n          <p></p>\n          The mode of transmission of helicobacter is unknown but studies show that people with helicobacter infections may have it\n          also in their saliva. So, in this study, 75% had helicobacter identified by molecular Probes. This has lead\n          to some people saying that transmission by saliva is common.\n\n        </div>\n      </div>\n    </div>\n\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_newc\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_newc\" aria-expanded=\"false\"\n            aria-controls=\"collapse_newc\">\n            <span class=\"increment_number\"></span> How much does an endoscopy machine cost?\n          </a>\n        </h5>\n      </div>\n\n      <div id=\"collapse_newc\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_newc\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.hmbendoscopy.com\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          The price varies. You can buy an endoscopy machine from 10 000$ up to 40 000$, at least based on the given URL.\n        </div>\n      </div>\n    </div>\n    <h3 id=\"procedure_heading\" style=\"color:#9d3c3c;\">Procedures</h3>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_a\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_a\" aria-expanded=\"false\" aria-controls=\"collapse_a\">\n            <span class=\"increment_number\"></span> Does an endoscopy procedure hurt, how long does it last (duration)?\n            <span class=\"opinion\">my opinion</span>\n          </a>\n        </h5>\n      </div>\n\n      <div id=\"collapse_a\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_a\">\n        <div>\n          <span class=\"url\">URL</span>\n          <!--  <a href=\"\" class=\"url\" target=\"_blank\">#1</a> -->\n        </div>\n        <div class=\"card-block\">\n          It doesn't hurt but it is uncomfortable. Some patients find it tough and some have no problems with it. In general, it is\n          not a pleasant procedure but as long as you keep calm and breathe it will be ok.\n          <p></p>\n          The endoscopy procedure lasts 5-15 minutes in general (based on my experience). Keep in mind that\n          5 minutes is more than enough for a skilled specialist to examine your oesophagus, stomach and duodenum.\n          <p></p>\n          If you go on for an endoscopy procedure several times you get used to it and in general it becomes a normal procedure.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_b\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_b\" aria-expanded=\"false\" aria-controls=\"collapse_b\">\n            <span class=\"increment_number\"></span> Can an endoscopy procedure rupture your esophagus/stomach, is it safe?\n            <span class=\"knowledge\">knowledge</span>\n          </a>\n        </h5>\n      </div>\n\n      <div id=\"collapse_b\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_b\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.mayoclinic.org/tests-procedures/endoscopy/basics/risks/prc-20020363\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          An endoscopy is a very safe procedure. Rare complications are the following:\n          <p></p>\n          <b>Bleeding</b> which may occur if a stomach polyp is removed or a biopsy is taken.\n          <br/>\n          <b>Infections</b>: most endoscopies consist of an examination and biopsy, and risk of infection is low. The risk\n          of infection increases when additional procedures are performed as part of your endoscopy.\n          <br/>\n          <b>Tearing of the gastrointestinal tract</b> occurs in an estimated 1 of every 2,500 to 11,000 diagnostic upper\n          endoscopies. The risk increases if additional procedures, such as dilation to widen your esophagus, are performed.\n          <p></p>\n          Risk can be reduced further by following exactly the commands from the doctor during the procedure (without anaesthesia)\n          and before the procedure.\n\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_c\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_c\" aria-expanded=\"false\" aria-controls=\"collapse_c\">\n            <span class=\"increment_number\"></span> Is there anything else apart from the endoscopy procedure to check my esophagus/stomach?\n            <span class=\"opinion\">my opinion</span>\n          </a>\n        </h5>\n      </div>\n\n      <div id=\"collapse_c\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_c\">\n        <div>\n          <span class=\"url\">URL</span>\n          <!--  <a href=\"http://www.hmbendoscopy.com\" class=\"url\" target=\"_blank\">#1</a> -->\n        </div>\n        <div class=\"card-block\">\n          There are other procedures (alternatives) such as barium swallow and capsule endoscopy but keep in mind that the standard\n          endoscopy procedure is the golden standard and the best way to clearly examine the situation inside your esophagus-stomach-duodenum\n          and even further inside your small intestine (example: biopsy for celiac disease). With this instrument the\n          specialist can have a thorough look inside all parts of your upper digestive tract.\n          <p></p>\n          If you take an alternative procedure into consideration then keep in mind that there is a high possibility for you to undergo\n          the standard endoscopy procedure to further examine your condition (if something shows up previously or if\n          you still experience some gastro symptoms)\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_d\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_d\" aria-expanded=\"false\" aria-controls=\"collapse_d\">\n            <span class=\"increment_number\"></span> How to prepare for an endoscopy procedure?\n            <span class=\"knowledge\">knowledge</span>\n          </a>\n        </h5>\n      </div>\n\n      <div id=\"collapse_d\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_d\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.mayoclinic.org/tests-procedures/endoscopy/basics/how-you-prepare/prc-20020363\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          Your doctor will give you specific instructions to prepare for your endoscopy. In some cases your doctor may ask that you:\n          <p></p>\n          <b>Fast before the endoscopy.</b> You will need to stop drinking and eating 4 to 8 hours before your endoscopy\n          to ensure your stomach is empty for the procedure. It needs to be empty in order to NOT throw up stomach content\n          when you will burp after the specialist puts the tube inside your and\n          <br/>\n          <b>Stop taking certain medications.</b> You will need to stop taking certain blood-thinning medications in the\n          days before your endoscopy. Blood thinners may increase your risk of bleeding if certain procedures are performed\n          during the endoscopy. If you have chronic conditions, such as diabetes, heart disease or high blood pressure,\n          your doctor will give you specific instructions regarding your medications.\n          <p></p>\n          Tell your doctor about all the medications and supplements you're taking before your endoscopy.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_e\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_e\" aria-expanded=\"false\" aria-controls=\"collapse_e\">\n            <span class=\"increment_number\"></span> Should I go for a sedation before my endoscopy procedure?\n            <span class=\"opinion\">my opinion </span>\n          </a>\n        </h5>\n      </div>\n\n      <div id=\"collapse_e\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_e\">\n        <div>\n          <span class=\"url\">URL</span>\n          <!-- <a href=\"http://www.hmbendoscopy.com\" class=\"url\" target=\"_blank\">#1</a> -->\n        </div>\n        <div class=\"card-block\">\n          It really depends. If you really think that you cannot endure 5-10 minutes with the endoscope inside your stomach then go\n          for it. Remember, an endoscopy is a safe procedure and the risks are minimal.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_017\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_017\" aria-expanded=\"false\" aria-controls=\"collapse_017\">\n            <span class=\"increment_number\"></span> How do I know if I have stomach perforation from endoscopy?\n            <!-- <span class=\"opinion\">my opinion </span> -->\n          </a>\n        </h5>\n      </div>\n\n      <div id=\"collapse_017\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_017\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"https://patient.info/forums/discuss/pain-after-endoscopy-chest-pain-discomfort-swallowing-584651\" class=\"url\" target=\"_blank\">#1</a>\n          <a href=\"https://www.mayoclinic.org/tests-procedures/endoscopy/about/pac-20395197\" class=\"url\" target=\"_blank\">#2</a>\n        </div>\n        <div class=\"card-block\">\n          This happens rarely.\n          <p></p>\n          Perforation would cause sudden unbearable pain, and you'd collapse in shock (nurse report).\n          <p></p>\n          Perforation symptoms can include:\n          <p></p>\n          <ul>\n            <li>Fever</li>\n            <li>Severe chest pain</li>\n            <li>Shortness of breath</li>\n            <li>Bloody, black or very dark colored stool</li>\n            <li>Difficulty swallowing</li>\n            <li>\n              <b>Severe</b> or persistent abdominal pain</li>\n            <li>Vomiting, especially if your vomit is bloody or looks like coffee grounds</li>\n          </ul>\n          <p></p>\n          Call your doctor or go to an emergency room if you experience any of these signs or symptoms.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_001\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_001\" aria-expanded=\"false\" aria-controls=\"collapse_001\">\n            <span class=\"increment_number\"></span> Is it safe to eat after upper endoscopy/gastroscopy procedure?\n            <span class=\"opinion\">my opinion </span>\n          </a>\n        </h5>\n      </div>\n\n      <div id=\"collapse_001\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_001\">\n        <div>\n          <span class=\"url\">URL</span>\n          <!-- <a href=\"http://www.hmbendoscopy.com\" class=\"url\" target=\"_blank\">#1</a> -->\n        </div>\n        <div class=\"card-block\">\n          It is safe to eat after the procedure. However, go with something light for the beginning. I went for an endoscopy\n            and after an hour/hour and half I started with some liquid then a bit later proceeded with some food.\n            Do not overeat!\n            <p></p>\n          The next day, you can eat normally.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_f\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_f\" aria-expanded=\"false\" aria-controls=\"collapse_f\">\n            <span class=\"increment_number\"></span> What is an esophageal manometry?\n          </a>\n        </h5>\n      </div>\n\n      <div id=\"collapse_f\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_f\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.mayoclinic.org/tests-procedures/esophageal-manometry/basics/why-its-done/prc-20014211\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          Your doctor may recommend esophageal manometry if you experience symptoms that could be related to an esophageal disorder.\n          Esophageal manometry provides information about the movement (motility) of food through the esophagus and into\n          the stomach. The test measures how well the circular bands of muscle (sphincters) at the top and bottom of\n          your esophagus open and close, as well as the pressure, strength and pattern of the wave of esophageal muscle\n          contractions that moves food along.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_g\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_g\" aria-expanded=\"false\" aria-controls=\"collapse_g\">\n            <span class=\"increment_number\"></span> What is the barium swallow procedure?\n          </a>\n        </h5>\n      </div>\n\n      <div id=\"collapse_g\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_g\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.hopkinsmedicine.org/healthlibrary/test_procedures/gastroenterology/barium_swallow_92,P07688/\" class=\"url\"\n            target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          A barium swallow is a radiographic (X-ray) examination of the upper gastrointestinal (GI) tract, specifically the pharynx\n          (back of mouth and throat) and the esophagus (a hollow tube of muscle extending from below the tongue to the\n          stomach). The pharynx and esophagus are made visible on X-ray film by a liquid suspension called barium sulfate\n          (barium). Barium highlights certain areas in the body to create a clearer picture.\n          <p></p>\n          A barium swallow may be performed to diagnose structural or functional abnormalities of the digestive tract such as: cancers,\n          tumors, hiatal hernia, structural problems, muscle disorders, achalasia, GERD and ulcers\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_h\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_h\" aria-expanded=\"false\" aria-controls=\"collapse_h\">\n            <span class=\"increment_number\"></span> What is a vagotomy operation. When is it appropriate to undergo such procedure?\n          </a>\n        </h5>\n      </div>\n\n      <div id=\"collapse_h\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_h\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"https://en.wikipedia.org/wiki/Vagotomy\" class=\"url\" target=\"_blank\">#1</a>\n        </div>\n        <div class=\"card-block\">\n          Vagotomy is a surgical procedure for peptic ulcer diseases which involves removing parts of the vagus nerve. The vagus nerve\n          is used to regulate the heartbeat and the muscle movement necessary to keep you breathing. This nerve also\n          regulates the chemical levels in the digestive system so that the intestines can process food and keep track\n          of what types of nutrients are being gained from the food that is taken in. Vagotomy was once commonly performed\n          to treat and prevent ulcer diseases. However, with the availability of excellent acid secretion control with\n          H2 receptor antagonists, such as cimetidine, ranitidine, and famotidine, and proton pump inhibitors (PPIs),\n          such as pantoprazole, rabeprazole, omeprazole, and lansoprazole, dexlansoprazole etc. the need for surgical\n          management of peptic ulcer disease has greatly decreased.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading71\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse71\" aria-expanded=\"false\" aria-controls=\"collapse71\">\n            <span class=\"increment_number\"></span> What is Nissen Fundoplication?\n          </a>\n          <span class=\"knowledge\">knowledge</span>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse71\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading71\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.webmd.com/heartburn-gerd/fundoplication-surgery-for-gastroesophageal-reflux-disease-gerd\" class=\"url\"\n            target=\"_blank\">#1</a>\n\n        </div>\n        <div class=\"card-block\">\n          During fundoplication surgery, the upper curve of the stomach (the fundus) is wrapped around the esophagus camera.gif and\n          sewn into place so that the lower portion of the esophagus passes through a small tunnel of stomach muscle.\n          This surgery strengthens the valve between the esophagus and stomach (lower esophageal sphincter), which stops\n          acid from backing up into the esophagus as easily. This allows the esophagus to heal.\n          <p></p>\n          If open surgery (which requires a large incision) is done, you will most likely spend several days in the hospital. A general\n          anesthetic is used, which means you sleep through the operation. After open surgery, you may need 4 to 6 weeks\n          to get back to work or your normal routine. If the laparoscopic method is used, you will most likely be in\n          the hospital for only 2 to 3 days. A general anesthetic is used. You will have less pain after surgery, because\n          there is no large incision to heal. After laparoscopic surgery, most people can go back to work or their normal\n          routine in about 2 to 3 weeks, depending on their work. After either surgery, you may need to change the way\n          you eat. You may need to eat only soft foods until the surgery heals. And you should chew food thoroughly and\n          eat more slowly to give the food time to go down the esophagus.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading72\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse72\" aria-expanded=\"false\" aria-controls=\"collapse72\">\n            <span class=\"increment_number\"></span> What is Stretta procedure?\n          </a>\n        </h5>\n\n      </div>\n\n      <div id=\"collapse72\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading72\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"https://en.wikipedia.org/wiki/Stretta_procedure\" class=\"url\" target=\"_blank\">#1</a>\n\n        </div>\n        <div class=\"card-block\">\n          Stretta is a minimally invasive endoscopic procedure for the treatment of gastroesophageal reflux disease (GERD) that delivers\n          radiofrequency energy in the form of electromagnetic waves through electrodes at the end of a catheter to the\n          lower esophageal sphincter (LES) and the gastric cardia - the region of the stomach just below the LES. The\n          energy heats the tissue, ultimately causing it to swell and stiffen; the way this works was not understood\n          as of 2015, but it was thought that perhaps the heat causes local inflammation, collagen deposition and muscular\n          thickening of the LES and that it may disrupt the nerves there. Its relative safety and efficacy are controversial,\n          with the American College of Gastroenterology recommending against its use in 2013, and in the same year the\n          Society of American Gastrointestinal and Endoscopic Surgeons (SAGES) giving it a strong recommendation for\n          people who refuse laparascopic Nissen fundoplication,\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading73\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse73\" aria-expanded=\"false\" aria-controls=\"collapse73\">\n            <span class=\"increment_number\"></span> What is LINX system, device for GERD patients?\n          </a>\n\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse73\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading73\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.linxforlife.com\" class=\"url\" target=\"_blank\">#1</a>\n\n        </div>\n        <div class=\"card-block\">\n          It\u2019s a simple device with life-changing potential. LINX is intended for patients diagnosed with Gastroesophageal Reflux Disease\n          (GERD) as defined by abnormal pH testing, and who are seeking an alternative to continuous acid suppression\n          therapy.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading74\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse74\" aria-expanded=\"false\" aria-controls=\"collapse74\">\n            <span class=\"increment_number\"></span> What is Barrett's ablation?\n          </a>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse74\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading74\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.medscape.com/viewarticle/724854\" class=\"url\" target=\"_blank\">#1</a>\n\n        </div>\n        <div class=\"card-block\">\n          Ablative therapies for Barrett's esophagus offer the promise of correction of the histological lesion without the attendant\n          risk of surgery. There has recently been renewed interest in this approach with the development of novel modalities\n          for ablative therapy. Data demonstrate that complete reversion to neosquamous epithelium is achievable in most\n          patients undergoing ablative therapy. However, data demonstrating a decrease in cancer risk following therapy\n          are scarce because most studies do not have the statistical power or comparator groups available to assess\n          cancer risk.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading75\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse75\" aria-expanded=\"false\" aria-controls=\"collapse75\">\n            <span class=\"increment_number\"></span> What is TIF procedure?\n          </a>\n\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse75\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading75\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.gerdhelp.com/about-tif/\" class=\"url\" target=\"_blank\">#1</a>\n\n        </div>\n        <div class=\"card-block\">\n          TIF procedure:</strong>\n\n          <ul>\n            <li>No scars, due to incisionless approach</li>\n            <li>Faster recovery, since there is no internal cutting of the natural anatomy</li>\n            <li>Fewer adverse events and complications than conventional surgery</li>\n            <li>Can be revised if required</li>\n          </ul>\n          <p></p>\n          The\n            <strong> TIF</strong> procedure is performed through the mouth without incisions. A surgeon utilizes the EsophyX device\n            to reconstruct the valve between the esophagus and the stomach and restore the body\u2019s natural protection against\n            reflux.\n          <p></p>\n          TIF is an acronym:\n          <p></p>\n          <ul>\n            <li>\n              <em>Transoral</em> \u2013 The procedure is performed from within the GI tract, through the patient\u2019s mouth</li>\n            <li>\n              <em>Incisionless</em> \u2013 There are no incisions, resulting in reduced risk and discomfort, faster recovery, and\n              no scars</li>\n            <li>\n              <em>Fundoplication</em> \u2013 The antireflux valve is reconstructed by wrapping the upper portion of the stomach\n              (fundus) around the esophagus</li>\n          </ul>\n        </div>\n\n\n\n      </div>\n    </div>\n    <!-- STATS STARTING HERE -->\n    <h3 id=\"statistic_heading\" style=\"color:#34919f;\">Statistics</h3>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_new1\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_new1\" aria-expanded=\"false\"\n            aria-controls=\"collapse_new1\">\n            <span class=\"increment_number\"></span> What is relative risk?\n          </a>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_new1\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_new1\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"https://www.ncbi.nlm.nih.gov/books/NBK63647/\" class=\"url\" target=\"_blank\">#1</a>\n\n        </div>\n        <div class=\"card-block\">\n            The relative risk (RR) of a bad outcome in a group given intervention is a proportional measure estimating\n            the size of the effect of a treatment compared with other interventions or no treatment at all. It is the\n            proportion of bad outcomes in the intervention group divided by the proportion of bad outcomes in the control\n            group.\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_new2\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_new2\" aria-expanded=\"false\"\n            aria-controls=\"collapse_new2\">\n            <span class=\"increment_number\"></span> What is absolute risk?\n          </a>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_new2\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_new2\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"https://patient.info/health/nhs-and-other-care-options/features/calculating-absolute-risk-and-relative-risk\" class=\"url\"\n            target=\"_blank\">#1</a>\n\n        </div>\n        <div class=\"card-block\">\n            Absolute risk of a disease is your risk of developing the disease over a time period. We all have absolute\n            risks of developing various diseases such as heart disease, cancer, stroke, etc. The same absolute risk can\n            be expressed in different ways. For example, say you have a 1 in 10 risk of developing a certain disease\n            in your life. This can also be said to be a 10% risk, or a 0.1 risk - depending on whether you use percentages\n            or decimals.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_new12\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_new12\" aria-expanded=\"false\"\n            aria-controls=\"collapse_new12\">\n            <span class=\"increment_number\"></span> What is the difference between prevalence and incidence?\n          </a>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_new12\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_new12\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.differencebetween.net/science/health/difference-between-prevalence-and-incidence/\" class=\"url\" target=\"_blank\">#1</a>\n\n        </div>\n        <div class=\"card-block\">\n\n            Prevalence in medical parlance refers to the number of cases of a disease in a population during a specific period of time.\n            It is used in reference to how widespread a disease has become and the ratio between those who are already\n            infected and those who are at risk. It is used to determine the total number of cases of a disease in a given\n            population and the impact that it has on society. It includes the length of time that the disease has been\n            encountered and takes into consideration old and new cases.\n            <p></p>\n            Incidence, on the other hand, refers to the rate of the manifestation of a certain disease. It is used to measure\n            the rate of occurrence of a disease at a given period usually dealing with the number of new cases that are\n            diagnosed within a population during a specific period.\n\n\n\n\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_new6\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_new6\" aria-expanded=\"false\"\n            aria-controls=\"collapse_new6\">\n            <span class=\"increment_number\"></span> What is hazard ratio?\n          </a>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_new6\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_new6\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.statisticshowto.com/hazard-ratio/\" class=\"url\" target=\"_blank\">#1</a>\n\n        </div>\n        <div class=\"card-block\">\n          The hazard ratio is a comparison between the probability of events in a treatment group, compared to the probability\n            of events in a control group. It\u2019s used to see if patients receiving a treatment progress faster (or slower)\n            than those not receiving treatment.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_new4\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_new4\" aria-expanded=\"false\"\n            aria-controls=\"collapse_new4\">\n            <span class=\"increment_number\"></span> What is a cohort study?\n          </a>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_new4\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_new4\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"http://www.statisticshowto.com/cohort-study/\" class=\"url\" target=\"_blank\">#1</a>\n\n        </div>\n        <div class=\"card-block\">\n          A Cohort study, used in the medical fields and social sciences, is an observational study used to estimate\n            how often disease or life events happen in a certain population. \u201CLife events\u201D might include: incidence rate,\n            relative risk or absolute risk.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_new11\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_new8\" aria-expanded=\"false\"\n            aria-controls=\"collapse_new8\">\n            <span class=\"increment_number\"></span> What is a case study?\n          </a>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_new8\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_new11\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"https://en.wikipedia.org/wiki/Case_study\" class=\"url\" target=\"_blank\">#1</a>\n\n        </div>\n        <div class=\"card-block\">\n          In the social sciences and life sciences, a case study is a research method involving an up-close, in-depth,\n            and detailed examination of a subject of study (the case), as well as its related contextual conditions.\n        </div>\n      </div>\n    </div>\n    <div class=\"card\">\n      <div class=\"card-header\" role=\"tab\" id=\"heading_new13\">\n        <h5 class=\"mb-0\">\n          <a data-toggle=\"collapse\" class=\"heading_link_size\" data-parent=\"#accordion\" href=\"#collapse_new13\" aria-expanded=\"false\"\n            aria-controls=\"collapse_new13\">\n            <span class=\"increment_number\"></span> What are confounding factors?\n          </a>\n\n        </h5>\n\n      </div>\n\n      <div id=\"collapse_new13\" class=\"collapse\" role=\"tabpanel\" aria-labelledby=\"heading_new12\">\n        <div>\n          <span class=\"url\">URL</span>\n          <a href=\"https://en.wikipedia.org/wiki/Confounding\" class=\"url\" target=\"_blank\">#1</a>\n          <a href=\"http://www.statisticshowto.com/experimental-design/confounding-variable/\" class=\"url\" target=\"_blank\">#2</a>\n        </div>\n        <div class=\"card-block\">\n          In statistics, a confounder (also confounding variable or confounding factor) is a variable that influences\n            both the dependent variable and independent variable causing a false association.\n            <p></p>\n          A confounding variable is an \u201Cextra\u201D variable that you didn\u2019t account for. They can ruin an experiment and\n            give you useless results. They can suggest there is correlation when in fact there isn\u2019t. They can even introduce\n            bias. That\u2019s why it\u2019s important to know what one is, and how to avoid getting them into your experiment in\n            the first place.</p>\n\n\n        </div>\n      </div>\n    </div>\n\n  </div>\n</div>\n\n</div>";

