  image7: '../../pics/organs/kidney.jpg',
  info_content7: 'Proton pump inhibitors (PPIs) are among the most commonly used drugs worldwide, and have been linked to acute interstitial nephritis. Less is known about the relationship between PPI use and chronic kidney disease (CKD).',

  date8: 'May 19, 2015',
  url8: 'https://www.ncbi.nlm.nih.gov/pmc/articles/PMC4575851/',
